(1, 1, '2020-04-05 13:21:25', '2020-04-05 13:21:25', '<!-- wp:paragraph -->\n<p>Welcome to WordPress. This is your first post. Edit or delete it, then start writing!</p>\n<!-- /wp:paragraph -->', 'Hello world!', '', 'publish', 'open', 'open', '', 'hello-world', '', '', '2020-04-05 13:21:25', '2020-04-05 13:21:25', '', 0, 'http://wp_mapbox/?p=1', 0, 'post', '', 1),
(2, 1, '2020-04-05 13:21:25', '2020-04-05 13:21:25', '<!-- wp:paragraph -->\n<p>This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>...or something like this:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:quote -->\n<blockquote class=\"wp-block-quote\"><p>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</p></blockquote>\n<!-- /wp:quote -->\n\n<!-- wp:paragraph -->\n<p>As a new WordPress user, you should go to <a href=\"https://wp_mapbox/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!</p>\n<!-- /wp:paragraph -->', 'Sample Page', '', 'publish', 'closed', 'open', '', 'sample-page', '', '', '2020-04-05 13:21:25', '2020-04-05 13:21:25', '', 0, 'http://wp_mapbox/?page_id=2', 0, 'page', '', 0),
(5, 1, '2020-04-05 13:27:23', '2020-04-05 13:27:23', '<label> Your Name (required)\n    [text* your-name] </label>\n\n<label> Your Email (required)\n    [email* your-email] </label>\n\n<label> Subject\n    [text your-subject] </label>\n\n<label> Your Message\n    [textarea your-message] </label>\n\n[submit \"Send\"]\nMapBox Locator plugin \"[your-subject]\"\nMapBox Locator plugin <wordpress@wp_mapbox>\nFrom: [your-name] <[your-email]>\nSubject: [your-subject]\n\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on MapBox Locator plugin (https://wp_mapbox)\nadmin@admin.com\nReply-To: [your-email]\n\n0\n0\n\nMapBox Locator plugin \"[your-subject]\"\nMapBox Locator plugin <wordpress@wp_mapbox>\nMessage Body:\n[your-message]\n\n-- \nThis e-mail was sent from a contact form on MapBox Locator plugin (https://wp_mapbox)\n[your-email]\nReply-To: admin@admin.com\n\n0\n0\nThank you for your message. It has been sent.\nThere was an error trying to send your message. Please try again later.\nOne or more fields have an error. Please check and try again.\nThere was an error trying to send your message. Please try again later.\nYou must accept the terms and conditions before sending your message.\nThe field is required.\nThe field is too long.\nThe field is too short.', 'Contact form 1', '', 'publish', 'closed', 'closed', '', 'contact-form-1', '', '', '2020-04-05 13:27:23', '2020-04-05 13:27:23', '', 0, 'http://wp_mapbox/?post_type=wpcf7_contact_form&p=5', 0, 'wpcf7_contact_form', '', 0),
