(60, 1, '2020-04-07 07:37:27', '2020-04-07 07:37:27', '<div class=\"w2mb-demo-prev-next-demos\">\r\n<span class=\"w2mb-demo-prev-demo\">Prev demo: <a href=\"https://wp_mapbox/mapbox-locator-plugin/\">Home page</a></span><span class=\"w2mb-demo-next-demo\">Next demo: <a href=\"https://wp_mapbox/ajax-map/\">AJAX Map</a></span>\r\n</div>\r\n\r\n<p>There is a simple way to position search and map elements without Visual Composer, SiteOrigin or any other page builder plugins using pure HTML and CSS. Since WordPress 5.0 it became much more easier and faster to build needed shortcodes and position elements using standard WP editor.</p>\r\n<p>Main feature of this page: both shortcodes (mapbox and mapbox-search) connected by same value of \"uid\" parameter, so they work together in AJAX mode.</p>\r\n\r\n<!-- wp:columns -->\r\n<div>\r\n<div style=\"float: left; width: 58%;\">\r\n[mapbox id=59]\r\n</div>\r\n<div style=\"float: right; width: 40%;\">\r\n[mapbox-search uid=\"u1\" columns=\"1\" advanced_open=\"1\" redirect=\"https://wp/\"]\r\n</div>\r\n</div>', 'Search + Map', '', 'publish', 'closed', 'closed', '', 'search-map', '', '', '2020-10-28 14:34:54', '2020-10-28 14:34:54', '', 0, 'http://wp_mapbox/search-map/', 0, 'page', '', 0),
