(2143, 2, '2014-02-03 10:16:02', '2014-02-03 10:16:02', '<div class=\"w2mb-docs\">\r\n<h3><strong>&#091;mapbox&#093;</strong></h3>\r\nThis shortcode is used to build MapBox (OpenStreetMap) maps with listings locations as map markers. The best way is to build a map in Maps Manager and use such kind of shortcode &#091;mapbox id=XXX&#093;, but it\'s possible to build custom map shortcode using following additional attributes:\r\n<table>\r\n<tr><th>Parameter</th><th class=\"th-description\"></th><th>Default</th></tr>\r\n<tr><td><strong>id</strong></td><td>This is ID of the map created in the Maps Manager</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>num</strong></td><td>Number of markers to display on map (-1 gives all markers).</td><td class=\"td-center\">-1</td></tr>\r\n<tr><td><strong>uid</strong></td><td>Enter unique string to connect this shortcode with the search form.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>width</strong></td><td>Set map width (by default whole possible width).</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>height</strong></td><td>Set map height.</td><td class=\"td-center\">400</td></tr>\r\n<tr><td><strong>radius_circle</strong></td><td>Display radius cycle on map when radius filter provided.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>clusters</strong></td><td>Group map markers in clusters.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>sticky_scroll</strong></td><td>Makes the map to be sticky on scroll.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>sticky_scroll_toppadding</strong></td><td>Sticky scroll top padding in pixels.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>map_style</strong></td><td>MapBox (OpenStreetMap) style. Whole list in directory settings.</td><td class=\"td-center\">default</td></tr>\r\n<tr><td><strong>show_summary_button</strong></td><td>Show \"« Summary\" button in info window.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>show_readmore_button</strong></td><td>Show \"Read more »\" button in info window.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>directions_sidebar_open</strong></td><td>Directions sidebar opened by default.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>ajax_loading</strong></td><td>When map contains lots of markers - this may slow down map markers loading. Select AJAX to speed up loading. Requires Starting Address or Starting Point coordinates Latitude and Longitude.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>ajax_markers_loading</strong></td><td>Maps info window AJAX loading. This may additionally speed up loading.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>use_ajax_loader</strong></td><td>Show spinner on AJAX requests.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>counter</strong></td><td>Show locations counter.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>counter_text</strong></td><td>Show spinner on AJAX requests.</td><td class=\"td-center\">Number of locations %d</td></tr>\r\n<tr><td><strong>start_address</strong></td><td>When map markers load by AJAX - it should have starting point and starting zoom. Enter start address or select latitude and longitude. Example: 1600 Amphitheatre Pkwy, Mountain View, CA 94043, USA.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>start_latitude</strong></td><td>Starting point latitude.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>start_longitude</strong></td><td>Starting point longitude.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>start_zoom</strong></td><td>Starting point zoom. Value from 0 (auto zoom) to 19.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>geolocation</strong></td><td>Enable automatic user Geolocation.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>draw_panel</strong></td><td>Enable Draw Panel.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>enable_full_screen</strong></td><td>Enable full screen button.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>enable_full_screen_by_default</strong></td><td>Map full screen opened by default.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>enable_wheel_zoom</strong></td><td>Enable zoom by mouse wheel. For desktops.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td style=\"font-size: 14px;\"><strong>enable_dragging_touchscreens</strong></td><td>Enable map dragging on touch screen devices.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>center_map_onclick</strong></td><td>Center map on marker click.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>center_map_onclick</strong></td><td>Center map on marker click. Value from 0 (auto zoom) to 19.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>search_on_map</strong></td><td>Show search form and listings panel on the map.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>search_on_map_open</strong></td><td>Search form open by default.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>order_by</strong></td><td>Possible values: post_date, title, rand, distance - when listings search in radius. Also this is possible to order by some content fields, those types have ordering functionality: text string, date-time, digital number, price. Just need to set content field slug as this attribute.</td><td class=\"td-center\">post_date</td></tr>\r\n<tr><td><strong>order</strong></td><td>Direction of sorting: ASC or DESC.</td><td class=\"td-center\">ASC</td></tr>\r\n<tr><td><strong>show_keywords_search</strong></td><td>Show keywords search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>keywords_ajax_search</strong></td><td>Enable listings autosuggestions by keywords.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>what_search</strong></td><td>Default keywords on the search form.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_categories_search</strong></td><td>Show categories search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>categories_search_level</strong></td><td>Categories search depth level on the search form (1,2,3).</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>category</strong></td><td>Select certain category ID on the search form.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>exact_categories</strong></td><td>List of categories on the search form. Comma separated string of categories slugs or IDs.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_address_search</strong></td><td>Show address search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>address</strong></td><td>Default address in the search form, recommended to set default radius.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_locations_search</strong></td><td>Show locations search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>locations_search_level</strong></td><td>Locations search depth level on the search form (1,2,3).</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>location</strong></td><td>Select certain location ID on the search form.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>exact_locations</strong></td><td>List of locations on the search form. Comma separated string of locations slugs or IDs.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>author</strong></td><td>Enter ID of author.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>categories</strong></td><td>Comma separated string of categories IDs or slugs - use only IDs or only slugs.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>locations</strong></td><td>Comma separated string of locations IDs or slugs - use only IDs or only slugs.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>include_categories_children</strong></td><td>Include children of selected categories and locations. When enabled - any subcategories or sublocations will be included as well.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>post__in</strong></td><td>Exact listings. Comma separated string of listings IDs. Possible to display exact listings.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>field_<em>SLUG</em></td><td colspan=\"2\">Possible to filter by content fields values like on the search form. Filters depend on fields types:\r\n<ul>\r\n	<li><strong>Text string and Textarea</strong> - filter in the following format: <strong>field_<em>SLUG</em>=\"string\"</strong></li>\r\n	<li><strong>Digital value</strong> - here are 2 variants: when content field was configured to search by exact values - <strong>field_<em>SLUG</em>=\"number\"</strong>; when content field was configured to search by MIN and MAX values - <strong>field_<em>SLUG</em>_min=\"number\"</strong> and/or <strong>field_<em>SLUG</em>_max=\"number\"</strong></li>\r\n	<li><strong>Price</strong> - the same as for Digital value type</li>\r\n	<li><strong>Date-Time</strong> - define date range in the following format: <strong>field_<em>SLUG</em>_min=\"dd.mm.yyyy\"</strong> and/or <strong>field_<em>SLUG</em>_max=\"dd.mm.yyyy\"</strong></li>\r\n	<li><strong>Select list, Radio buttons and Checkboxes</strong> - filter in the following format: <strong>field_<em>SLUG</em>=\"comma separated selection items IDs\"</strong>. Select list, Radio buttons support only single ID.</li>\r\n</ul></td></tr>\r\n</table>\r\n\r\n<hr />\r\n\r\n<h3><strong>&#091;mapbox-search&#093;</strong></h3>\r\nThis shortcode builds the search form connected with the map. Parameters of this shortcode:\r\n<table>\r\n<tr><th>Parameter</th><th class=\"th-description\"></th><th>Default</th></tr>\r\n<tr><td><strong>uid</strong></td><td>Enter unique string to connect this shortcode with the map.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>advanced_open</strong></td><td>Advanced search panel is opened by default.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>show_keywords_search</strong></td><td>Show keywords search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>keywords_ajax_search</strong></td><td>Enable listings autosuggestions by keywords.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>keywords_placeholder</strong></td><td>Default keyword on the search form.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_categories_search</strong></td><td>Show categories search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>categories_search_level</strong></td><td>Categories search depth level on the search form (1,2,3).</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>category</strong></td><td>Select certain category ID on the search form.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>exact_categories</strong></td><td>List of categories on the search form. Comma separated string of categories slugs or IDs.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_address_search</strong></td><td>Show address search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>address</strong></td><td>Default address, recommended to set default radius.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_locations_search</strong></td><td>Show locations search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>locations_search_level</strong></td><td>Locations search depth level on the search form (1,2,3).</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>location</strong></td><td>Select certain location ID on the search form.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>exact_locations</strong></td><td>List of locations on the search form. Comma separated string of locations slugs or IDs.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_radius_search</strong></td><td>Show the search by radius.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>radius</strong></td><td>Default radius.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>search_fields</strong></td><td>Select certain content fields in main search section (comma separated IDs).</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>search_fields_advanced</strong></td><td>Select certain content fields in advanced search section (comma separated IDs).</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>search_bg_color</strong></td><td>Search form background HEX color.</td><td class=\"td-center\">by setting*</td></tr>\r\n<tr><td><strong>search_bg_opacity</strong></td><td>Search form background opacity (in percents).</td><td class=\"td-center\">100</td></tr>\r\n<tr><td><strong>search_text_color</strong></td><td>Search form text HEX color.</td><td class=\"td-center\">by setting*</td></tr>\r\n<tr><td><strong>search_overlay</strong></td><td>Enable/disable search form overlay image.</td><td class=\"td-center\">by setting*</td></tr>\r\n<tr><td><strong>scroll_to</strong></td><td>Scroll to listings, map or do not scroll after search button was pressed.</td><td class=\"td-center\">listings</td></tr>\r\n<tr><td><strong>hide_search_button</strong></td><td>Allows to hide search button.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>on_row_search_button</strong></td><td>Search button on one line with fields.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>sticky_scroll</strong></td><td>Make search form to be sticky on scroll.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>sticky_scroll_toppadding</strong></td><td>Sticky scroll top padding in pixels.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>field_<em>SLUG</em></td><td colspan=\"2\">Possible to filter by content fields values. Filters depend on fields types:\r\n<ul>\r\n	<li><strong>Text string and Textarea</strong> - filter in the following format: <strong>field_<em>SLUG</em>=\"string\"</strong></li>\r\n	<li><strong>Digital value</strong> - here are 2 variants: when content field was configured to search by exact values - <strong>field_<em>SLUG</em>=\"number\"</strong>; when content field was configured to search by MIN and MAX values - <strong>field_<em>SLUG</em>_min=\"number\"</strong> and/or <strong>field_<em>SLUG</em>_max=\"number\"</strong></li>\r\n	<li><strong>Price</strong> - the same as for Digital value type</li>\r\n	<li><strong>Date-Time</strong> - define date range in the following format: <strong>field_<em>SLUG</em>_min=\"dd.mm.yyyy\"</strong> and/or <strong>field_<em>SLUG</em>_max=\"dd.mm.yyyy\"</strong></li>\r\n	<li><strong>Select list, Radio buttons and Checkboxes</strong> - filter in the following format: <strong>field_<em>SLUG</em>=\"comma separated selection items IDs\"</strong>. Select list, Radio buttons support only single ID.</li>\r\n</ul></td></tr>\r\n</table>\r\n\r\n<hr />\r\n\r\n<h3><strong>&#091;mapbox-submit&#093;</strong></h3>\r\nWorks only when <a href=\"https://www.salephpscripts.com/wordpress_maps/demo/documentation/#frontend\">Frontend submission & dashboard addon</a> was enabled. This shortcode builds listings submission pages.\r\n\r\n<hr />\r\n\r\n<h3><strong>&#091;mapbox-dashboard&#093;</strong></h3>\r\nWorks only when <a href=\"https://www.salephpscripts.com/wordpress_maps/demo/documentation/#frontend\">Frontend submission & dashboard addon</a> was enabled. Logged in users have an ability to manage their listings and profile on the frontend dashboard page. This shortcode doesn\'t have any parameters.\r\n\r\n<hr />\r\n\r\n<h3><strong>&#091;mapbox-submit-button&#093;</strong></h3>\r\nWorks only when <a href=\"https://www.salephpscripts.com/wordpress_maps/demo/documentation/#frontend\">Frontend submission & dashboard addon</a> was enabled. Renders \"<em>Submit new listing</em>\" button. This shortcode doesn\'t have any attributes.', 'Shortcodes', 'Aenean gravida dapibus mollis. Praesent non nisl risus. Morbi dolor mauris, sodales sed bibendum et, interdum sed orci.', 'publish', 'closed', 'closed', '', 'shortcodes', '', '', '2020-07-09 08:22:21', '2020-07-09 08:22:21', '', 0, 'http://wp/?page_id=2143', 0, 'page', '', 0),
(17741, 2, '2019-01-08 18:20:28', '2019-01-08 18:20:28', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"installation\">Installation</h2>\nTo add a WordPress Plugin using the built-in plugin installer:\n<ol>\n	<li>Go to \"Plugins -&gt; Add New\".</li>\n	<li>Click \"Upload Plugin\" button.</li>\n	<li>Choose downloaded ZIP file and click \"Install Now\" button.</li>\n	<li>Make sure that you click on \"Activate the plugin\". Now you have installed directory plugin.</li>\n	<li><em>(required)</em> Generate an Envato API Personal Token by clicking this <a href=\"https://build.envato.com/create-token/?purchase:download=t&purchase:verify=t\" target=\"_blank\" rel=\"noopener noreferrer\">link</a>, take purchase code from your codecanon <a href=\"https://codecanyon.net/downloads\" target=\"_blank\" rel=\"noopener noreferrer\">downloads page</a>, then go to Maps Admin -> Maps Settings page and enter generated access token and purchase code into appropriate settings fields.</li>\n	<li><em>(required)</em> Create new page with <strong>&#091;mapbox&#093;</strong> shortcode. Also you might want to create additional pages for frontend submission and dashboard with <strong>&#091;mapbox-submit&#093;</strong> and <strong>&#091;mapbox-dashboard&#093;</strong> shortcodes if you wish your logged in users to manage their listings and profile on the <a href=\"[base_url]/documentation/frontend/\">frontend dashboard page</a>.</li>\n</ol>\n\n<h4 id=\"multisite\">WordPress Multisite installation</h4>\nUpload the plugin on Network Admin plugins page, <strong>but don\'t activate it</strong>. It is not allowed to enable \"Network Activate\" for the plugin on Network plugins page, instead activate it on the plugins page of each sub-site. Also note, that each activation on each sub-site requires separate license.\n</div>\n\n[sc name=\"docs menu\"]		', 'Documentation', '\n						', 'publish', 'closed', 'closed', '', 'documentation', '', '', '2019-01-08 18:20:28', '2019-01-08 18:20:28', '', 0, 'http://wp/?page_id=17741', 0, 'page', '', 0),
(17752, 2, '2019-01-08 18:50:35', '2019-01-08 12:50:35', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"installation\">Installation</h2>\nTo add a WordPress Plugin using the built-in plugin installer:\n<ol>\n	<li>Go to \"Plugins -&gt; Add New\".</li>\n	<li>Click \"Upload Plugin\" button.</li>\n	<li>Choose downloaded ZIP file and click \"Install Now\" button.</li>\n	<li>Make sure that you click on \"Activate the plugin\". Now you have installed directory plugin.</li>\n	<li><em>(required)</em> Generate an Envato API Personal Token by clicking this <a href=\"https://build.envato.com/create-token/?purchase:download=t&purchase:verify=t\" target=\"_blank\" rel=\"noopener noreferrer\">link</a>, take purchase code from your codecanon <a href=\"https://codecanyon.net/downloads\" target=\"_blank\" rel=\"noopener noreferrer\">downloads page</a>, then go to Maps Admin -> Maps Settings page and enter generated access token and purchase code into appropriate settings fields.</li>\n	<li><em>(required)</em> Create new page with <strong>&#091;mapbox&#093;</strong> shortcode. Also you might want to create additional pages for frontend submission and dashboard with <strong>&#091;mapbox-submit&#093;</strong> and <strong>&#091;mapbox-dashboard&#093;</strong> shortcodes if you wish your logged in users to manage their listings and profile on the <a href=\"[base_url]/documentation/frontend/\">frontend dashboard page</a>.</li>\n</ol>\n\n<h4 id=\"multisite\">WordPress Multisite installation</h4>\nUpload the plugin on Network Admin plugins page, <strong>but don\'t activate it</strong>. It is not allowed to enable \"Network Activate\" for the plugin on Network plugins page, instead activate it on the plugins page of each sub-site. Also note, that each activation on each sub-site requires separate license.\n</div>\n\n[sc name=\"docs menu\"]		', 'Installation', '\n						', 'publish', 'closed', 'closed', '', 'installation', '', '', '2019-01-08 18:50:35', '2019-01-08 12:50:35', '', 17741, 'http://wp/?page_id=17752', 0, 'page', '', 0);
