(17797, 2, '2019-02-09 17:46:03', '2019-02-09 11:46:03', '<div class=\"w2mb-docs w2mb-docs-side\">\r\n<h2 id=\"update\">Automatic update</h2>\r\nThe plugin supports <strong>automatic updates</strong>, you just need to use Personal Access Token and your purchase code from codecanyon as described in installation instructions. Personal Access Token required for automatic updates.\r\n\r\n<i class=\"fa fa-exclamation-triangle\"></i> You should be logged in at <a href=\"https://account.envato.com/sign_in?to=envato-api\" target=\"_blank\" rel=\"noopener noreferrer\">Envato API</a>. Generate an Envato API Personal Token by clicking this <a href=\"https://build.envato.com/create-token/?purchase:download=t&purchase:verify=t&purchase:list=t\" target=\"_blank\" rel=\"noopener noreferrer\">link</a>\r\n\r\nFollowing permissions should be checked:\r\n<img src=\"[base_url]/wp-content/uploads/token_permissions.png\" />\r\n\r\n\r\n<h2 id=\"manual\">Manual update</h2>\r\n<ol>\r\n<li>It would be better to make backups of the database and all plugin files before update. All your configurations, settings and data will be saved after update, you will not lose anything. Do not forget to clear cache of your site (if any caching system is used) and in the browser. Files modifications must follow <a href=\"[base_url]/documentation/customization\">customization instructions</a>, in this case they will be saved during update. Your translated languages files must be saved in \"<em>wp-content/languages/plugins/</em>\" folder.</li>\r\n\r\n<li>First of all download the latest version of the plugin from Codecanyon.</li>\r\n\r\n<li>Simply unpack the archive with new version and upload all new files and folders from <em>w2mb/</em> folder to your plugin folder on the host (usually the name of this folder on the host is \"<em>wp-content/plugins/w2mb/</em>\")</li>\r\n\r\n<li>That is all, the system will automatically execute all needed operations. All files and folders must be uploaded using FTP-client (like FileZilla) or using file manager in your hosting control panel.</li>\r\n</ol>\r\n\r\n<i class=\"fa fa-exclamation-triangle\"></i> If you have any problems after update - double check you uploaded all new files and did not miss any file or folder. Do not forget to clear cache of your site (if any caching system is used) and in the browser.\r\n</div>\r\n\r\n[sc name=\"docs menu\"]', 'Update', '\n						', 'publish', 'closed', 'closed', '', 'update', '', '', '2020-07-09 08:07:57', '2020-07-09 08:07:57', '', 17741, 'http://wp/?page_id=17797', 0, 'page', '', 0),
(17809, 2, '2019-02-09 20:08:28', '2019-02-09 20:08:28', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"maps_listings\">Maps listings</h2>\n\nMaps listings are very much like standard WordPress posts, except some things and additional features. In wordpress terminology \"Maps listings\" are posts of custom post type, they store in the database, in wordpress tables with all their meta data. Theoretically they can be used by another 3rd party plugins, in the same way as native WP posts. This gives huge space for compatibility and custom development. Of course, for some 3rd party plugins it requires special adaptation.\n\n<h3 id=\"listings_creation\">Listings creation and management</h3>\n\n<ol>\n	<li>To have an ability to create listings at the frontend - it is required to enable Frontend submission and dashboard addon and create a <a href=\"[base_url]/documentation/frontend/submit/\">page with &#091;mapbox-submit&#093; shortcode</a>.\n\nAfter successfull submission at the frontend listing gets special status. You can read more in the <a href=\"[base_url]/documentation/frontend/listing-live-cycle/\">listing live cycle</a>.\n</li>\n	<li>At the backend create new listing at the <em>\"Maps listings -> Create new listing\"</em> page</li>\n</ol>\n\nListings administration page may contain standard WordPress fields and metaboxes such as: title field, richtext editor for listing description, slug and excerpt fields, author metabox, comments metabox. Also, according to the listing settings, this page contains special metaboxes: listing categories, listing locations, content fields, media metabox with forms for images uploading and YouTube videos embedding, ratings stats, contact email field, claim options metabox.\n\nEach directory listing has special metabox on its administration page:\n\n<img src=\"[base_url]/wp-content/uploads/listing_info_metabox.png\" alt=\"\" width=\"282\" height=\"161\" class=\"alignnone size-full wp-image-18152\" />\n\n\"<em>Listing Info</em>\" metabox have some information fields: listing status, total clicks, sorting date and expiration date.\n\n<i class=\"fa fa-exclamation-triangle\"></i> listing status is not the same thing as post status, listing status can be \"<em>active</em>\" or \"<em>expired</em>\". Post status can be \"<em>published</em>\", \"<em>pending review</em>\" or \"<em>draft</em>\".\n\n<img src=\"[base_url]/wp-content/uploads/administration_listing_row.png\" alt=\"\" width=\"810\" height=\"152\" class=\"alignnone size-full wp-image-18153\" />\n\nListing row on \"<em>Maps listings</em>\" page and \"<em>Listing Info</em>\" metabox have \"<em>renew listing</em>\" links.\n\n<h3 id=\"listings_renew\">Renew listing option</h3>\n\nThis option displays when \"<a href=\"[base_url]/documentation/settings/listings/\">Listings will never expire</a>\" setting has not been enabled and current listing is under \"<em>expired</em>\" status. This feature processes maps listing renewal. After renew process was completed successfully the listing status becomes \"<em>active</em>\" and the system sets new expiration date. Also this function raises up the listing to the top of all lists, those ordered by date.\n</div>\n\n[sc name=\"docs menu\"]		', 'Maps listings', '\n						', 'publish', 'closed', 'closed', '', 'maps-listings', '', '', '2019-02-09 20:08:28', '2019-02-09 20:08:28', '', 17741, 'http://wp/?page_id=17809', 0, 'page', '', 0),
(17822, 2, '2019-02-15 17:26:37', '2019-02-15 17:26:37', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"directory_categories\">Maps categories</h2>\n\nSite admin may create/edit/delete special categories items. Management of categories tree has exactly the same functionality as standard WordPress categories, but these are separate items and have special administration page \"<em>Maps listings -&gt; Maps categories\"</em>.\n\n<i class=\"fa fa-star\"></i> Custom icons have ability to be associated with maps categories displaying in the search form dropdown. Default icons files place in \"<em>resources/images/categories_icons/</em>\" folder of the plugin. Site administrator can upload custom icons into \"<em>w2mb-plugin/resources/images/categories_icons/</em>\" folder of your child theme via the Files manager of hosting control panel or via FTP.\n<i class=\"fa fa-exclamation-triangle\"></i> The plugin uses only one folder for icons: native folder or custom folder in your child theme when exists.\n<img src=\"[base_url]/wp-content/uploads/search_icons.png\" class=\"alignnone size-full wp-image-18350\" />\n\nUsing <a href=\"[base_url]/documentation/settings/maps-addresses/\">Font Awesome icons</a> it is possible to select specific marker icon and color for each category.\n\n<img src=\"[base_url]/wp-content/uploads/category_icons.png\" alt=\"\" width=\"879\" height=\"118\" class=\"alignnone size-full wp-image-18157\" />\n\n<i class=\"fa fa-star\"></i> Additional content fields can be <a href=\"[base_url]/documentation/content-fields/\">dependent from categories</a>. Admin configure specific fields to display when appropriate category was selected.\n</div>\n\n[sc name=\"docs menu\"]		', 'Maps Categories', '\n						', 'publish', 'closed', 'closed', '', 'maps-categories', '', '', '2019-02-15 17:26:37', '2019-02-15 17:26:37', '', 17741, 'http://wp/?page_id=17822', 0, 'page', '', 0),
(17826, 2, '2019-02-15 17:32:19', '2019-02-15 17:32:19', '<div class=\"w2mb-docs w2mb-docs-side\">\r\n<h2 id=\"directory_locations\">Maps locations</h2>\r\nThere are 3 ways to provide locations functionality on maps site:\r\n<ol>\r\n	<li><strong>Use predefined locations</strong> - this way users are able to use <a href=\"#predefined_locations\">previously defined locations</a> for their listings. Autocomplete on addresses fields and \"Get my location\" button on addresses fields should be <a href=\"[base_url]/documentation/settings/advanced/#miscellaneous\">disabled</a>. So addresses fields will be used by users to manually fill in streets, buildings, postal codes, e.t.c. Also <a href=\"[base_url]/documentation/settings/search/\">search by address</a> should be disabled in the search form. Visitors will search listings only by previously defined locations drop-down menu. Actually radius search is not necessary in this method.</li>\r\n	<li><strong>Use addresses fields</strong> - do not need to insert predefined locations. Users will use only addresses fields, <a href=\"[base_url]/documentation/settings/advanced/#miscellaneous\">autocomplete function</a> and \"Get my location\" button on addresses fields can help them. Listings addresses fields (address line 1, address line 2, zip code) should contain whole information about country, state, city, region, streets, buildings, postal codes e.t.c. To get correct search results with nearby locations it is quite recommended to enable search by radius and set up default radius value in the <a href=\"[base_url]/documentation/settings/search/\">search settings</a>.</li>\r\n	<li><strong>Both methods</strong> <em>(default)</em> - usage of predefined locations + addresses fields. But in this case information in addresses fields may contain country, state, city, region, the same as selected predefined locations. It is recommended to exclude <a href=\"#locations_levels\">locations levels</a> from address line.</li>\r\n</ol>\r\n\r\n<img src=\"[base_url]/wp-content/uploads/locations_search_options.png\" />\r\n\r\nSome additional explanation about plugin search engine and its fields <a href=\"[base_url]/documentation/search\">here</a>.\r\n\r\n<h3 id=\"predefined_locations\">Predefined locations</h3>\r\nSite admin may create/edit/delete special predefined locations items. Management of directory locations tree has exactly the same functionality as standard WordPress categories, but these are separate items and have special administration page \"<em>Maps listings -&gt; Maps locations</em>\"\r\n\r\n<i class=\"fa fa-star\"></i> Custom icons may be associated with maps locations displaying in the search form dropdown. Default icons files place in \"<em>resources/images/locations_icons/</em>\" folder of the plugin. Site administrator can upload custom icons into \"<em>w2dc-plugin/resources/images/locations_icons/</em>\" folder of your child theme via the Files manager of hosting control panel or via FTP.\r\n<i class=\"fa fa-exclamation-triangle\"></i> The plugin uses only one folder for icons: native folder or custom folder in your child theme when exists.\r\n\r\n<img src=\"[base_url]/wp-content/uploads/location_icons.png\" />\r\n\r\nAfter <a href=\"#locations_levels\">locations levels</a> were successfully configured and locations tree completed - users may select any predefined location from select boxes group on create/edit listing page.\r\n\r\n<img src=\"[base_url]/wp-content/uploads/predefined_locations.png\" />\r\n\r\n<i class=\"fa fa-star\"></i> <a href=\"[base_url]/documentation/settings/listings/\">Listings</a> have an option to allow users to select more than 1 location for each listing.\r\n\r\n<h3 id=\"locations_levels\">Locations levels</h3>\r\n\r\nJust in some words, locations levels - these are names of nesting levels of directory locations tree. By default there are 3 locations levels: <strong>Country, State and City</strong>. Site admin can manage locations levels and exclude any of them from address strings. Also it is possible users can add new locations at the frontend submission form, \'Add Country\', \'Add State\' e.t.c. links appear below locations dropdowns.\r\n\r\nWhen your maps site will be used locally, for example, for visitors from one country or one state/region - do not delete unnecessary locations levels and predefined locations, they are required to set correct location point at the MapBox map during listings creation/edition. You can just exclude needed locations levels from address line - there is such option for each locations level, it allows to build custom address line at the frontend. See examples:\r\n\r\n<img src=\"[base_url]/wp-content/uploads/locations_levels_addresses.png\" />\r\n\r\nAlso when you set up local maps site - it is recommended to fill in \"<em>Default country/state for correct geocoding</em>\" <a href=\"[base_url]/documentation/settings/maps-addresses/\">setting</a>.\r\n</div>\r\n\r\n[sc name=\"docs menu\"]		', 'Maps Locations', '\n						', 'publish', 'closed', 'closed', '', 'maps-locations', '', '', '2020-07-09 08:18:35', '2020-07-09 08:18:35', '', 17741, 'http://wp/?page_id=17826', 0, 'page', '', 0),
(17828, 2, '2019-02-15 17:35:04', '2019-02-15 17:35:04', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"maps_settings\">Maps settings</h2>\nFirst of all look at \"<em>Maps Admin -&gt; Maps settings</em>\" page. There are some separate tabs with own groups of settings.\n\nAfter successful installation of the plugin generate and enter license information. Generate an Envato API Personal Token and enter Purchase code, follow <a href=\"[base_url]/documentation/installation/\">installation instructions</a>.\n\n<h3 id=\"general_tab\">General settings tab</h3>\n<img src=\"[base_url]/wp-content/uploads/settings.png\" alt=\"\" width=\"606\" height=\"878\" class=\"alignnone size-full wp-image-18168\" />\nThere are 2 available addons, if you do not need unnecessary functionality - do not enable them:\n\n<strong>Frontend submission &amp; dashboard addon</strong> - allow users to <a href=\"[base_url]/documentation/frontend/\">submit new listings</a> at the frontend side of your site, also provides users dashboard functionality.\n\n<strong>Ratings addon</strong> - ability to place ratings for listings, then manage these ratings by listings owners.\n\n<i class=\"fa fa-exclamation-triangle\"></i> Refresh settings page after switch on/off any addon.\n\n<h4 id=\"mapbox_api_keys\">MapBox API key</h4>\nGet your MapBox Access Token <a href=\"https://www.mapbox.com/account/\" target=\"_blank\" rel=\"noopener noreferrer\">here</a>.\n</div>\n\n[sc name=\"docs menu\"]		', 'Maps Settings', '\n						', 'publish', 'closed', 'closed', '', 'settings', '', '', '2019-02-15 17:35:04', '2019-02-15 17:35:04', '', 17741, 'http://wp/?page_id=17828', 0, 'page', '', 0),
(17834, 2, '2019-02-15 17:39:30', '2019-02-15 11:39:30', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"frontend_submission\">Frontend submission and dashboard</h2>\nThese are additional settings for <a href=\"[base_url]/documentation/frontend\">frontend submission</a>, they become available when \"<em>Frontend submission & dashboard addon</em>\" was enabled.\n\n<strong>Select frontend submission login mode</strong> -\n<ul>\n	<li><strong>login required</strong> - logged in users have an ability to manage their listings and profile on the frontend dashboard page.</li>\n	<li><strong>necessary to fill in user info form</strong> - user info form asks user to fill in his name and email fields. After successful submission Wordpress creates new user profile. If user with entered email already exists in the system - it isn\'t required to create new profile and listing will just be assigned with existed user. Later admin may manage and contact new user when needed. For new user registration email with automatically generated password will be sent.</li>\n	<li><strong>not necessary to fill in user info form</strong> - the same behaviour as for previous option, but it is not required to enter contact info. For empty contact form the system creates anonymous user profile. Registration email will be sent only when user enters his email.</li>\n	<li><strong>do not even show user info form</strong> - Wordpress creates new anonymous user profile in the system, but no login information will be sent, just because there is no email to send.</li>\n</ul>\n<img src=\"[base_url]/wp-content/uploads/submission_form.png\" class=\"alignnone size-full wp-image-18326\" />\n\n<strong>Enable pre-moderation of listings</strong> - moderation will be required for all listings.\n\n<strong>Enable moderation after a listing was modified</strong> - with enabled moderation listing status become pending after any edition.\n\n<strong>Enable submit listing button on listing page</strong> - show/hide submission button in listing window. In some cases web developers can place own custom submission link or button somewhere else, for instance in main menu of a site. Also the page with <strong>&#091;mapbox-submit&#093;</strong> shortcode is required to show this button.\n<img src=\"[base_url]/wp-content/uploads/submission_button.png\" class=\"alignnone size-full wp-image-18342\" />\n\n<strong>Hide top admin bar at the frontend for regular users</strong> - when this option enabled - regular user will never see backend of your site. It is recommended to enable when you have the page with <strong>&#091;mapbox-dashboard&#093;</strong> shortcode.\n\n<strong>Allow users to manage own profile at the frontend dashboard</strong> - enable this option if you wish your users to manage own profile at the frontend dashboard page.\n\n<strong>Enable listings tags input at the frontend</strong> - during listing creation/edition you may hide tags input.\n\n<strong>Require Terms of Services on submission page?</strong> - select or create new WordPress page containing your TOS agreement and assign it using this setting.\n\n<strong>Use custom login page for listings submission process</strong> - when submission requires login - user has to login using default login form. But web developer can use 3rd party plugin to make custom login page and then assign it with submission process using this setting.\n\n<strong>Use custom login page for login into dashboard</strong> - the same as previous setting. Assign custom login page for frontend dashboard.\n</div>\n\n[sc name=\"docs menu\"]		', 'Frontend Submission', '\n						', 'publish', 'closed', 'closed', '', 'frontend-submission', '', '', '2019-02-15 17:39:30', '2019-02-15 11:39:30', '', 17828, 'http://wp/?page_id=17834', 0, 'page', '', 0),
(17838, 2, '2019-02-18 16:02:38', '2019-02-18 10:02:38', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"claim\">Claim Functionality</h2>\nFollowing settings appear at the General Settings tab of \"<em>Maps Admin -> Maps Settings</em>\" page when \"<em>Frontend submission & dashboard addon</em>\" is enabled.\n\n<strong>Enable claim functionality</strong> - enable/disable claim functionality at the frontend. When enabled - each listing has option \"allow claim\", by checking this option you allow <strong>registered</strong> users to claim this listing. When claim allowed – the button \"Is this you ad?\" appears on listing\'s details page, this button opens claim form. <span style=\"text-decoration: underline;\">This button appears</span> only when user is not logged in as current listing owner, Frontend submission addon was enabled and when page with <strong>&#091;mapbox-dashboard&#093;</strong> <a href=\"[base_url]/documentation/frontend/\">shortcode exists</a>.\n<img src=\"[base_url]/wp-content/uploads/claim_button.png\" />\n\nWhen claim request was sent – notification about claim for this listing will be sent to the current listing owner.\n\nAfter approval claimer will become owner of this listing and receive email notification about successful approval.\n\nAlso there is the option in <a href=\"[base_url]/documentation/import/\">CSV importer</a> to set up all imported listings as claimable.\n\n<strong>Approval of claim required</strong> - when switched on any claimed listing requires approval of claim by current listing owner. In other case claim will be processed immediately without any notifications.\n\n<strong>What will be with listing status after successful approval?</strong> - when set to \"just approval\" option – the status of claimed listing will not be changed after approval. \"Expired status\" option means that after approval of claimed listing – it becomes expired and new owner have to renew it to make listing active.\n\n<strong>Hide contact form on claimable listings</strong> - just hide contact form when listing is set to be claimed.\n\n<strong>Hide claim metabox at the frontend dashboard</strong> - with this setting only admin may set up listing to be claimed.\n</div>\n\n[sc name=\"docs menu\"]		', 'Claim Functionality', '\n						', 'publish', 'closed', 'closed', '', 'claim', '', '', '2019-02-18 16:02:38', '2019-02-18 10:02:38', '', 17828, 'http://wp/?page_id=17838', 0, 'page', '', 0),
(17840, 2, '2019-02-18 16:04:40', '2019-02-18 10:04:40', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"listings_tab\">Listings settings tab</h2>\n<strong>Map marker slug</strong> - this value appears in URL when map marker selected https://yoursite.com/#w2mb-marker=1234\n\n<strong>Listings slug</strong> - This value appears in URL when listing window opened https://yoursite.com/#w2mb-listing=1234\n\n<strong>Listings will never expire</strong> - with this option listings will never expire.\n\n<strong>Active period of listings (in days)</strong>, <strong>Active period of listings (in months)</strong>, <strong>Active period of listings (in years)</strong> - with these settings listings will expire within a specified time. <em>Note, that listings remember all these settings at their time of creation and follow them even if settings will be changed in future. This means that if listing was created when \"Listings will never expire\" setting was enabled - it will never expire, even after this setting have been disabled. And visa versa, listing will expire within a specified time if it was created with enabled active period.</em>\n\n<strong>Allow regular users to change listings expiration dates</strong> - with this enabled setting listings owners may manually set expiration dates of listings, after that date the status of listing become expired. The change of expiration dates available only for listings with limited active period, not for eternal listings. Administrators may control expiration dates even if this option is disabled.\n\n<strong>Allow listings to renew</strong> - after expiration listings may be renewed on dashboard.\n\n<strong>Allow unlimited categories</strong> - there isn\'t any limit on assigned categories within each listing.\n\n<strong>Number of categories allowed for each listing</strong> -  the number of categories allowed to be assigned with listings. When during listing creation/edition user exceeded this number - the warning message will arise.\n\n<strong>Number of locations allowed for each listing</strong> -  an ability to set exact number of locations/markers allowed for each listing.\n\n<strong>Number of images allowed for each listing (including logo)</strong> -  set max number of images allowed for each listing.\n\n<strong>Number of videos allowed for each listing</strong> -  set max number of videos allowed for each listing.\n\n<h4 id=\"listing_window\">Listing Window</h4>\n<strong>Enable map in listing window</strong> - enable map for listing window.\n\n<strong>Show directions panel in listing window</strong> - directions panel will be shown on listing window when map enabled for listing window.\n\n<strong>Enable contact form in listing window</strong> - whether to show contact listing owner form in a separate tab listing window.\n\n<strong>Contact Form 7 shortcode</strong> - the plugin was adapted to work with Contact Form 7 plugin. Insert shortcode generated by CF 7 plugin in this field and CF 7 form will be displayed instead of standard contact form. This will work only when CF 7 plugin enabled, otherwise standard contact form will be displayed.\n\n<strong>Show contact form only for logged in users</strong> - only logged in users will see contact form in listing window (Contact Form 7 or standard form).\n\n<strong>Allow custom contact emails</strong> - users can fill in custom contact email, otherwise contact messages will be sent directly to listing authors email address from his profile.\n\n<strong>Enable report form</strong> - whether to show report form in listing window. An email will be sent to the administration email address.\n\n<strong>Hide listings views counter</strong> - whether to show total clicks on the listing.\n\n<strong>Hide listings creation date</strong> - listings creation date will be hidden at the frontend.\n\n<strong>Hide author information</strong> - author name and possible link to author website will be hidden on single listing pages.\n\n<strong>Listings comments system</strong> - select what to use: plugin\'s system or native installed system.\n\n<strong>Listings comments mode</strong> - with enabled option \"As configured in WP settings\" comments visibility depends on WordPress discussion settings - \"Allow people to post comments on new articles\". Also it depends on individual listing setting \"Allow comments\" on each listing edit screen.\n\n<strong>Listing tabs order</strong> - sort tabs in listing window.\n\n<strong>Enable statistics functionality</strong> - statistics charts visible on frontend users dashboard. At the backend only total number of clicks visible.\n\n<h4 id=\"description_excerpt\">Description &amp; Excerpt settings</h4>\n<strong>Enable description field</strong> - main description text editor can be hidden from listing.\n\n<strong>Enable summary field</strong> - summary/excerpt field can be hidden from listing.\n\n<strong>Excerpt max length</strong> - insert the number of words you want to show in the listings excerpts.\n\n<strong>Use cropped content as excerpt</strong> - when excerpt field wasn\'t filled in by user - cropped description content will be used.\n\n<strong>Strip HTML from excerpt</strong> - check the box if you want to strip HTML from the excerpt content.\n</div>\n\n[sc name=\"docs menu\"]', 'Listings Settings', '\n						', 'publish', 'closed', 'closed', '', 'listings', '', '', '2019-02-18 16:04:40', '2019-02-18 10:04:40', '', 17828, 'http://wp/?page_id=17840', 0, 'page', '', 0),
(17842, 2, '2019-02-18 16:13:21', '2019-02-18 10:13:21', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"listings_logos\">Listings logos &amp; images</h2>\nFollowing settings place on Listings settings tab of the \"<em>Maps Admin -> Maps settings</em>\" page.\n\n<strong>Enable logo in infowindow</strong> - switch on/off listings logo images in map marker infowindow.\n\n<strong>Enable lightbox on images gallery</strong> - switch on/off lightbox effect for images gallery in listing window.\n\n<strong>Enable automatic rotating slideshow on images gallery</strong> - switch on/off auto slider for images gallery in listing window.\n\n<strong>The delay in rotation (in ms)</strong> - the delay between rotation of slides (in milliseconds).\n\n<strong>Exclude logo image from images gallery</strong> - logo image will be visible only in map sidebar and marker info window, it will be excluded from single listing page.\n\n<strong>Enable default logo image</strong> - when logo image file was not uploaded the directory will show default image.\n\n<strong>Default logo image</strong> - this image will appear when listing owner did not upload own logo.\n\n<strong>100% width of images gallery</strong> - make images gallery full width in listing window. When disabled - next setting will be used.\n\n<strong>Images gallery width on single listing page (in pixels)</strong> - this option works when previous setting was switched off. Images gallery on listing page places at the left side within provided width, right side contains text information.\n\n<strong>Images gallery height on single listing page (in pixels)</strong> - set to 0 to fit full height.\n\n<strong>Do crop images gallery</strong> - this setting fits images for their proportions you preferred on your site: \"Cut off image to fit width and height of main slide\" for popular rectangular images (in this case images may be scaled and cut off) or \"Full image inside main slide\" for tall and thin images (so images will be scaled to be fully placed inside main slide). This setting works when gallery height is limited (not set to 0).\n</div>\n\n[sc name=\"docs menu\"]		', 'Listings logos & images', '\n						', 'publish', 'closed', 'closed', '', 'listings-logos-images', '', '', '2019-02-18 16:13:21', '2019-02-18 10:13:21', '', 17828, 'http://wp/?page_id=17842', 0, 'page', '', 0),
(17848, 2, '2019-02-18 16:17:57', '2019-02-18 10:17:57', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"ratings_settings\">Ratings settings</h2>\nFollowing settings place on Listings settings tab of the \"<em>Maps Admin -> Maps settings</em>\" page.\n\n<i class=\"fa fa-exclamation-triangle\"></i> All these settings appears when ratings addon is active.\n\n<img src=\"[base_url]/wp-content/uploads/rating_stars.png\" />\n\n<strong>Only registered users may place ratings</strong> - this setting restricts unregistered users to rate listings, when this setting unchecked - anyone can rate any listing. Please note, that when user places new rating, the plugin creates new record with ID of registered member, for anonymous users - the plugin stores their IPs, also the plugin saves cookie in user\'s browser. User can change his rating later.\n\n<strong>Show rating in map info window</strong> - renders 5-stars rating in map info window.\n\n<strong>Allow users to flush ratings of own listings</strong> - when this option was checked - listing owner has ability to flush current rating of his listing.\n</div>\n\n[sc name=\"docs menu\"]		', 'Ratings Settings', '\n						', 'publish', 'closed', 'closed', '', 'ratings', '', '', '2019-02-18 16:17:57', '2019-02-18 10:17:57', '', 17828, 'http://wp/?page_id=17848', 0, 'page', '', 0),
(17851, 2, '2019-02-18 16:19:36', '2019-02-18 10:19:36', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"search_tab\">Search settings tab</h2>\nThis settings tab places on \"<em>Maps Admin -> Maps settings</em>\" page.\n\n<strong>&#091;mapbox-search&#093;</strong> <a href=\"[base_url]/shortcodes/\">shortcode</a> and <a href=\"[base_url]/documentation/widgets/\">search widget</a> do not follow some of these settings. They have own parameters.\n\nSome additional explanation about plugin search engine and its fields <a href=\"[base_url]/documentation/search/\">here</a>.\n\n<strong>Enable categories search</strong> - enable/disable categories menu in the search field.\n\n<strong>Categories search depth level</strong> - 1, 2 or 3 levels of categories tree to display in categories menu.\n\n<strong>Enable keywords search</strong> - enable/disable search by keywords.\n\n<strong>Enable listings autosuggestions by keywords</strong> - enables autosuggestions by entered words.\n\n<strong>Keywords examples</strong> - comma separated words to show below the search field.\n\n<strong>Enable locations search</strong> - enable/disable locations menu in the search field.\n\n<strong>Locations search depth level</strong> - 1, 2 or 3 levels of locations tree to display in locations menu.\n\n<strong>Enable address search</strong> - enable/disable search by address. Addresses field has autocomplete functionality by MapBox (OpenStreetMap).\n\n<strong>Show listings counts in locations search dropboxes</strong> - whether to show number of listings assigned with current location in brackets.\n\n<strong>Hide empty locations</strong> - this setting is actual for main search block, search widget and locations menus.\n\n<strong>Show listings counts in categories search dropboxes</strong> - whether to show number of listings assigned with current category in brackets.\n\n<strong>Hide empty categories</strong> - this setting is actual for main search block, search widget and categories menus.\n\n<strong>Show locations radius search</strong> - show/hide radius slider in search form.\n\n<strong>Dimension in radius search</strong> - which dimension to use: miles or kilometers.\n\n<strong>Minimum radius search</strong> - set the minimum value for radius slider.\n\n<strong>Maximum radius search</strong> - set the maximum value for radius slider.\n\n<strong>Default radius search</strong> - this value will be set by default in radius slider. If you have problems with radius search: check your MapBox Access Token. Check geolocation response.\n\n<img src=\"[base_url]/wp-content/uploads/locations_search_options.png\" />\n</div>\n\n[sc name=\"docs menu\"]		', 'Search Settings', '\n						', 'publish', 'closed', 'closed', '', 'search', '', '', '2019-02-18 16:19:36', '2019-02-18 10:19:36', '', 17828, 'http://wp/?page_id=17851', 0, 'page', '', 0),
(17853, 2, '2019-02-18 16:21:12', '2019-02-18 10:21:12', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"maps_tab\">Maps &amp; Addresses</h2>\n\nThis settings tab places on \"<em>Directory Admin -> Directory settings</em>\" page.\n\n<h4 id=\"addresses_settings\">Addresses settings</h4>\n\n<strong>Default country/state for correct geocoding</strong> - this value needed when you build local directory, all your listings place in one local area - country, state or city. This hidden string will be automatically added to the address for correct geocoding when users create/edit listings and when they search by address.\n\n<strong>Address format</strong> - order address elements as you wish, commas and spaces help to build address line.\n\n<strong>Restriction of address fields for one specific country (autocomplete submission and search fields)</strong> - restrict autocomplete functionality by maps service only to one selected country or keep it worldwide.\n\n<strong>Enable address line 1 field</strong> - enabled/disable address line 1 field in locations metaboxes.\n\n<strong>Enable address line 2 field</strong> - enabled/disable address line 2 field in locations metaboxes.\n\n<strong>Enable zip code</strong> - enabled/disable zip code field in locations metaboxes.\n\n<strong>Enable additional info field</strong> - enabled/disable additional info field in locations metaboxes.\n\n<strong>Enable manual coordinates fields</strong> - enabled/disable manual coordinates fields in locations metaboxes.\n\n<strong>Default map zoom level (for submission page)</strong> - this zoom level is used during listing submission, the range is 1-19. 1 - the lowest zoom (whole world), 19 - the highest zoom (individual buildings, if available).\n\n<h4 id=\"map_infowindow_settings\">Map markers &amp; InfoWindow settings</h4>\n\n<strong>Allow users to select markers</strong> - if disabled - only default markers will be used.\n\n<strong>Type of Map Markers</strong> - 2 possible types:\n<ol>\n	<li>Font Awesome icons (recommended) - icons from the Font Awesome set will be used.</li>\n	<li>PNG images - images files from <em>\"resources/images/map_icons/icons/\"</em> folder of the plugin. Site administrator can upload custom icons into \"<em>w2mb-plugin/resources/images/map_icons/icons/</em>\" folder of your child theme via the Files manager of hosting control panel or via FTP.\n<i class=\"fa fa-exclamation-triangle\"></i> The plugin uses only one folder for PNG icons: native folder or custom folder in your child theme when exists.</li>\n</ol>\n\nUsing Font Awesome icons it is possible to select default icon and color of map marker. When \"Custom markers on the map\" option enabled in listings levels settings - users will be able to select specific icon for each marker. On <em>\"Maps listings -&gt; Maps categories\"</em> page it is allowed to select specific marker icon and color for each category.\n\n<img src=\"[base_url]/wp-content/uploads/category_icons.png\" />\n\nOther settings related to custom PNG images. Do not touch these settings if you do not know what they mean. Modification of these settings needed when you use own custom map markers icons with own sizes. If you are using custom markers PNG images, it is recommended, they all be of same size.\n\n<img src=\"[base_url]/wp-content/uploads/map_marker_structure.png\" />\n</div>\n\n[sc name=\"docs menu\"]		', 'Maps & Addresses', '\n						', 'publish', 'closed', 'closed', '', 'maps-addresses', '', '', '2019-02-18 16:21:12', '2019-02-18 10:21:12', '', 17828, 'http://wp/?page_id=17853', 0, 'page', '', 0),
(17855, 2, '2019-02-18 16:22:27', '2019-02-18 10:22:27', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"emails_tab\">Email notifications tab</h2>\nThis settings tab places on \"<em>Maps Admin -> Maps settings</em>\" page.\n\n<i class=\"fa fa-exclamation-triangle\"></i> If you have any problems with email sending/receiving - look at the <a href=\"[base_url]/documentation/troubleshooting\">troubleshooting section</a>.\n\n<strong>This email will be used for notifications to admin and in \"From\" field. Required to send emails.</strong> - enter admin email address.\n\n<strong>Days before pre-expiration notification will be sent</strong> - one-time email with pre-expiration notification text will be sent to the email box of listing owner.\n\n<strong>Pre-expiration notification</strong> - tags allowed: [listing] - listing name, [days] - number of days from previous setting, [link] - the link on the listing.\n\n<strong>Expiration notification</strong> - tags allowed: [listing] - listing name and [link] - the link on the listing.\n\n<strong>Registration of new user notification</strong> (this is <a href=\"[base_url]/documentation/frontend\">frontend submission addon</a> setting) - tags allowed: [author] - listing author name, [listing] - listing name, [login] - user login, [password] - user password, automatically generated by the system.\n\n<strong>Notification to admin about new listing creation</strong> (this is <a href=\"[base_url]/documentation/frontend\">frontend submission addon</a> setting) - tags allowed: [user] - listing author name, [listing] - listing name, [link] - the link on the listing.\n\n<strong>Notification to admin about listing modification and pending status</strong> (this is <a href=\"[base_url]/documentation/frontend\">frontend submission addon</a> setting) - tags allowed: [user] - listing author name, [listing] - listing name, [link] - the link on the listing.\n\n<strong>Notification to author about successful listing approval</strong> (this is <a href=\"[base_url]/documentation/frontend\">frontend submission addon</a> setting) - tags allowed: [author] - listing author name, [listing] - listing name, [link] - the link on the listing.\n\n<strong>Notification of claim to current listing owner</strong> (this is <a href=\"[base_url]/documentation/frontend\">frontend submission addon</a> setting) - tags allowed: [author] - the name of current author of the listing, [listing] - listing name, [claimer] - claimer user name, [link] - the link to approve or reject the claim, [message] - message from claimer.\n\n<strong>Notification of successful approval of claim</strong> (this is <a href=\"[base_url]/documentation/frontend\">frontend submission addon</a> setting) - tags allowed: [listing] - listing name, [claimer] - claimer user name, [link] - the link on the listing.\n\n<strong>Notification of claim decline</strong> (this is <a href=\"[base_url]/documentation/frontend\">frontend submission addon</a> setting) - tags allowed: [listing] - listing name, [claimer] - claimer user name.\n</div>\n\n[sc name=\"docs menu\"]		', 'Email Notifications', '\n						', 'publish', 'closed', 'closed', '', 'email-notifications', '', '', '2019-02-18 16:22:27', '2019-02-18 10:22:27', '', 17828, 'http://wp/?page_id=17855', 0, 'page', '', 0),
(17858, 2, '2019-02-18 16:27:18', '2019-02-18 10:27:18', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"advanced_tab\">Advanced settings</h2>\n\nThis settings tab places on \"<em>Maps Admin -> Maps settings</em>\" page.\n\n<h4 id=\"javascript_settings\">JavaScript &amp; CSS</h4>\n\n<strong>Include plugin JS and CSS files on all pages</strong> - sometimes it is required to enable this option.\n\n<strong>Enable lightbox slideshow</strong> - this adds functionality to watch listings images as full size animated slideshow. Also may be disabled in order to avoid conflicts with other javascript slideshow plugins.\n\n<strong>Do not include jQuery UI CSS</strong> - some themes and 3rd party plugins include own jQuery UI CSS - this may cause conflicts in styles.\n\n<h4 id=\"miscellaneous\">Miscellaneous</h4>\n\n<strong>Prevent users to see media items of another users</strong> - by default WordPress allows users to manage ANY attachments owned by other users at the backend dashboard panel. This option prevent such behaviour.\n\n<strong>Enable autocomplete on addresses fields</strong> - disable if you are using predefined locations tree and do not want to see country, city, e.t.c. in the input autocomplete field.\n\n<strong>Enable \"Get my location\" button on addresses fields</strong> - enable/disable geolocation button on addresses fields. Requires HTTPS.\n\n<h4 id=\"recaptcha_settings\">reCaptcha settings</h4>\n\nreCaptcha is used on contact listing owner forms and frontend submission form. You may get your reCAPTCHA API Keys <a href=\"https://www.google.com/recaptcha\" target=\"_blank\" rel=\"noopener noreferrer\">here</a>\n\n<h4 id=\"wpml_settings\">WPML Settings</h4>\nThis section appears when WPML plugin is active.\n\n<strong>Force WPML language on maps</strong> - ignore the browser\'s language setting and force it to display information in a particular WPML language.\n\n<strong>Enable frontend translations management</strong> (this is <a href=\"[base_url]/documentation/frontend\">frontend submission addon</a> setting) - enable/disable management of translations on users frontend dashboard.\n</div>\n\n[sc name=\"docs menu\"]		', 'Advanced Settings', '\n						', 'publish', 'closed', 'closed', '', 'advanced', '', '', '2019-02-18 16:27:18', '2019-02-18 10:27:18', '', 17828, 'http://wp/?page_id=17858', 0, 'page', '', 0),
(17861, 2, '2019-02-18 16:33:19', '2019-02-18 10:33:19', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"customization_tab\">Customization</h2>\nThis settings tab places on \"<em>Maps Admin -> Maps settings</em>\" page.\n\n<h4 id=\"color_palettes\">Color palettes</h4>\n\n<strong>Compare palettes at the frontend</strong> - this setting enables special interactive widget helping to compare color palettes. Do not forget to switch off this setting when comparison will be completed.\n\n<img src=\"[base_url]/wp-content/uploads/color_palette_widget.png\" />\n\nWhen you want to finish and hide this widget - click bottom link and you\'ll be redirected to the settings page, preferred color palette already will be selected and you just need to save changes. While you didn\'t disable comparison setting, this widget still be at the frontend.\n\n<strong>Color palette</strong> - selecting any of palettes will automatically change color settings below, like links and buttons colors, background of the search form, primary and secondary colors, jQuery UI style. Changes will not appear until you click save button.\n\nIt would be better to experiment and test other customization settings directly on the site.\n</div>\n\n[sc name=\"docs menu\"]		', 'Customization Settings', '\n						', 'publish', 'closed', 'closed', '', 'customization', '', '', '2019-02-18 16:33:19', '2019-02-18 10:33:19', '', 17828, 'http://wp/?page_id=17861', 0, 'page', '', 0);
INSERT INTO `wp_posts` (`ID`, `post_author`, `post_date`, `post_date_gmt`, `post_content`, `post_title`, `post_excerpt`, `post_status`, `comment_status`, `ping_status`, `post_password`, `post_name`, `to_ping`, `pinged`, `post_modified`, `post_modified_gmt`, `post_content_filtered`, `post_parent`, `guid`, `menu_order`, `post_type`, `post_mime_type`, `comment_count`) VALUES
(17867, 2, '2019-02-18 16:37:49', '2019-02-18 10:37:49', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"content_fields\">Content fields & content fields groups</h2>\nAdditional content fields is one of the most important part of the maps and classifieds sites. They allow to add some additional information to maps listings. <span style=\"text-decoration: underline;\">Content fields take part in the search and sorting of listings</span>. On <em>\"Maps Admin -&gt; Content fields</em>\" page admin can order existing content fields by drag &amp; drop rows in the table.\n\n<img src=\"[base_url]/wp-content/uploads/content_fields-links.png\" />\n\nEach field type defines own behaviour and view of a content field. There are settings to hide field name, select custom field icon, set field as required, manage visibility on pages. Listings can be <a href=\"[base_url]/documentation/ordering\">ordered</a> by some content fields. Note, that you can assign fields for specific categories.\n\nContent fields types:\n\n<table>\n<tr><th>Field</th><th>Type name</th><th>Core</th><th>Searchable</th><th>Sortable</th></tr>\n<tr><td><strong>Content</strong></td><td>content</td><td class=\"td-center\">+</td><td class=\"td-center\">+</td><td class=\"td-center\"\">-</td></tr>\n<tr><td><strong>Excerpt</strong></td><td>excerpt</td><td class=\"td-center\">+</td><td class=\"td-center\">+</td><td class=\"td-center\">-</td></tr>\n<tr><td><strong>Listing addresses</strong></td><td>address</td><td class=\"td-center\">+</td><td class=\"td-center\">+</td><td class=\"td-center\">-</td></tr>\n<tr><td><strong>Listing categories</strong></td><td>categories</td><td class=\"td-center\">+</td><td class=\"td-center\">+</td><td class=\"td-center\">-</td></tr>\n<tr><td><strong>Listing tags</strong></td><td>tags</td><td class=\"td-center\">+</td><td class=\"td-center\">+</td><td class=\"td-center\">-</td></tr>\n<tr><td><strong>Text string</strong></td><td>string</td><td class=\"td-center\">-</td><td class=\"td-center\">+</td><td class=\"td-center\">+</td></tr>\n<tr><td><strong>Textarea</strong></td><td>textarea</td><td class=\"td-center\">-</td><td class=\"td-center\">+</td><td class=\"td-center\">-</td></tr>\n<tr><td><strong>Digital value</strong></td><td>number</td><td class=\"td-center\">-</td><td class=\"td-center\">+</td><td class=\"td-center\">+</td></tr>\n<tr><td><strong>Select list</strong></td><td>select</td><td class=\"td-center\">-</td><td class=\"td-center\">+</td><td class=\"td-center\">-</td></tr>\n<tr><td><strong>Radio buttons</strong></td><td>radio</td><td class=\"td-center\">-</td><td class=\"td-center\">+</td><td class=\"td-center\">-</td></tr>\n<tr><td><strong>Checkboxes</strong></td><td>checkbox</td><td class=\"td-center\">-</td><td class=\"td-center\">+</td><td class=\"td-center\">-</td></tr>\n<tr><td><strong>Website URL</strong></td><td>website</td><td class=\"td-center\">-</td><td class=\"td-center\">-</td><td class=\"td-center\">-</td></tr>\n<tr><td><strong>Email</strong></td><td>email</td><td class=\"td-center\">-</td><td class=\"td-center\">-</td><td class=\"td-center\">-</td></tr>\n<tr><td><strong>Date-Time</strong></td><td>datetime</td><td class=\"td-center\">-</td><td class=\"td-center\">+</td><td class=\"td-center\">+</td></tr>\n<tr><td><strong>Price</strong></td><td>price</td><td class=\"td-center\">-</td><td class=\"td-center\">+</td><td class=\"td-center\">+</td></tr>\n<tr><td><strong>Opening hours</strong></td><td>hours</td><td class=\"td-center\">-</td><td class=\"td-center\">-</td><td class=\"td-center\">-</td></tr>\n<tr><td><strong>File upload</strong></td><td>fileupload</td><td class=\"td-center\">-</td><td class=\"td-center\">-</td><td class=\"td-center\">-</td></tr>\n</table>\n\nThere are <strong>5 core field types</strong>, during initial installation the system creates 5 content fields. Core fields have special destination. This is impossible to delete any of these fields. But it is possible to disable content and excerpt fields on <a href=\"[base_url]/documentation/settings/listings/#description_excerpt\">Listings settings tab</a>, \"Enable listings tags input at the frontend\" setting on <a href=\"[base_url]/documentation/settings/frontend-submission/\">General settings</a> tab controls tags input. Listing addresses and listing categories can be disabled in <a href=\"[base_url]/documentation/settings/listings/\">listings</a> settings. You can\'t edit slugs of core fields, can\'t order by them, can\'t set specific categories list, can\'t use in search.\n\nAbout customization of content fields at the frontend. Each content field has following classes in their HTML output:\n<ul>\n	<li><strong>w2mb-field-output-block</strong> - common class</li>\n	<li><strong>w2mb-field-output-block-{type name}</strong> - specific to content field type name (take from the list above)</li>\n	<li><strong>w2mb-field-output-block-{ID}</strong> - specific to content field ID</li>\n</ul>\n\nThe plugin can use custom template files for each content field. Content field template files place in \"<em>templates/content_fields/fields/</em>\" folder. In order to customize input and output templates - create or copy needed template file with the following name structure (take type name from the list above):\n<ul>\n	<li><strong>{type name}_output_{ID}.tpl.php</strong> - for the frontend markup</li>\n	<li><strong>{type name}_input_{ID}.tpl.php</strong> - for the backend input markup</li>\n</ul>\nSo custom template files will be used instead of native templates. Follow <a href=\"[base_url]/documentation/customization\">customization instructions</a>.\n\n<h3 id=\"content_fields_settings\">Content fields settings</h3>\n\n<strong>Field name</strong> - required and used on listings administration page and in the search block.\n\n<strong>Field slug</strong> - this option required and isn\'t able to edit for core fields.\n\n<strong>Hide name</strong> - when checked - the name of field will be hidden at frontend pages.\n\n<strong>Only admins can see what was entered</strong> - this option allows to hide entered information of this field for any users except admins.\n\n<strong>Field description</strong> - this will be like a hint for users who fill in details into a field.\n\n<strong>Icon image</strong> - select an icon from Font Awesome icons list for any content field, it will be displayed at frontend pages.\n\n<strong>Field type</strong> - it is possible to change field type, but only for non-core fields.\n\n<strong>Is this field required?</strong> - most of types of fields can be set as required and some can not - listings categories, listings tags, listings addresses.\n\n<strong>Order by field</strong> - listings may be <a href=\"[base_url]/documentation/ordering\">ordered by content fields</a>\n\n<strong>On listings sidebar</strong> - show value of this field on listings sidebar near the map.\n\n<strong>On listing page</strong> - show value of this field on listings pages.\n\n<strong>In map marker InfoWindow</strong> - show value of this field in map marker info window.\n\n<strong>Search by this field</strong> - take part in the search of listings. Some field types have special configuration options.\n\n<strong>On advanced search panel</strong> - when disabled - this field will appear directly on the search form, when enabled - this field will be hidden by default and appear only in advanced search block: \"More filters\" and \"Less filters\" switcher on the search form.\n\nNow in details about each content field type:\n<h3 id=\"content_field_settings\">Description (<em>core field type</em>)</h3>\n\nAt the backend this is richtext editor field to store general content of listings. Can\'t be ordered by its value, can\'t be searched by its value. By default this field is hidden on index and excerpt pages and visible only on listings pages.\n\n<h3 id=\"excerpt_field_settings\">Summary (<em>core field type</em>)</h3>\n\nThe WordPress Excerpt is an optional summary or description of a listing; in short, a listing summary. Can\'t be ordered by its value, can\'t be searched by its value. By default this field is shown on index and excerpt pages and hidden only on listings pages. It is possible to set up max length of output, also possible to use cropped content as excerpt, when excerpt field is empty - cropped main content will be used (look at Listings settings tab).\n\n<h3>Listings addresses (<em>core field type</em>)</h3>\nThis is a block of listing locations and addresses. Can\'t be ordered by its value, can\'t be required, has special search block. This block of fields is controlled by <a href=\"[base_url]/documentation/maps-locations/\">locations manager</a> and <a href=\"[base_url]/documentation/settings/maps-addresses/\">listings addresses settings</a>.\n<h3>Listings categories (<em>core field type</em>)</h3>\nThis is a block of categories, those were assigned to listing. Can\'t be ordered by its value, can\'t be required, has special search block. This block of fields is controlled by <a href=\"[base_url]/documentation/maps-categories\">categories manager</a> and <a href=\"[base_url]/documentation/settings/listings/\">listings settings</a>.\n<h3>Listings tags (<em>core field type</em>)</h3>\nThis is a block of tags, those were assigned to listing. Can\'t be ordered by its value, can\'t be required.\n\n<h3 id=\"text_field_settings\">Text string</h3>\nUses to insert short text/string data, for instance, <span style=\"text-decoration: underline;\">phone number</span>. Can be ordered by its value, can be required, can take part in search. Has own special configuration and search configuration options:\n\n<strong>Max length</strong> - max number of characters allowed in this field.\n\n<strong>PHP RegEx template</strong> - this interesting option allows to set the format of field. For example, such RegEx: <em>\\(?([1-9]\\d{2})(\\)?)(-|.|\\s)?([1-9]\\d{2})(-|.|\\s)?(\\d{4})</em> matches phone number format: (xxx) xxx-xxxx\n\n<strong>Is phone field?</strong> - for mobile devices adds special phone tag when this field is used as phone number.\n\nSearch configuration options:\n\n<strong>Search input mode</strong> - \"Search by keywords field\" - no additional input field appears on the search form, search through keywords field. Or \"Render own search field\" option.\n\n<h3 id=\"textarea_field_settings\">Textarea</h3>\nUses to insert long text and/or HTML. Listings can\'t be ordered by this field, but it can take part in the search (as separate search field or through keywords search field). The same search configuration page as for the text string type. Has following configuration options:\n\n<strong>Max length</strong> - max number of characters allowed in this field.\n\n<strong>HTML editor enabled</strong> - enable richtext editor.\n\n<strong>Run shortcodes</strong> - enable to process shortcodes inside this field.\n\nSearch configuration options:\n\n<strong>Search input mode</strong> - \"Search by keywords field\" - no additional input field appears on the search form, search through keywords field. Or \"Render own search field\" option.\n\n<h3 id=\"number_field_settings\">Digital value</h3>\nUses to insert numeric data. Can be ordered by its value, can be required, can take part in search. Has own special configuration options:\n\n<strong>Is integer or decimal</strong> - choose how to format the value of this field.\n\n<strong>Decimal separator</strong> - possible values: dot or comma.\n\n<strong>Thousands separator</strong> - possible values: no separator, dot, comma or space.\n\n<strong>Min</strong> - you may set minimum bound of this field. Leave empty if you do not need to limit this field.\n\n<strong>Max</strong> - you may set maximum bound of this field. Leave empty if you do not need to limit this field.\n\nSearch configuration options:\n\n<strong>Search mode</strong> - 4 modes available:\n<ul>\n	<li>Enter exact number into the text input</li>\n	<li>Enter min-max numbers into the text inputs</li>\n	<li>Search using min-max combination of select boxes</li>\n	<li>Search range slider with steps from Min-Max options</li>\n	<li>Search range slider with step 1, enter exact range</li>\n</ul>\n<strong>Min-Max options</strong> - for 2nd and 3rd search modes. Complete the list of options for select boxes or range slider.\n\n<h3 id=\"select_field_settings\">Select list</h3>\nAt the backend displays as selectbox HTML input element. To show this field - first of all on the configuration page admin must complete selection items. Listings can\'t be ordered by this content field, but can be searched by selected items. On the search form these items will be displayed as a group of checkboxes inputs or selectbox or radio buttons group.\n\nSearch configuration options:\n\n<strong>Search input mode</strong> - how to display inputs: checkboxes inputs or selectbox or radio buttons group.\n\n<strong>Operator for the search</strong> - it works only in checkboxes mode. OR - any item present is enough, will find listings with any of selected items. AND - require all items, will find listings will all items, those were selected in the search form.\n\n<strong>Items counter</strong> - on the search form shows the number of listings per item (in brackets).\n<img src=\"[base_url]/wp-content/uploads/checkboxes_items_count.png\" />\n\n<h3 id=\"radio_field_settings\">Radio buttons</h3>\nFields of this type inherit all features and settings of \"<em>select list</em>\" field type. The only difference is that the backend displays as radio buttons group. To show this field - first of all on the configuration page admin must complete selection items. Listings can\'t be ordered by this content field, but can be searched by selected items. On the search form these items will be displayed as a group of checkboxes inputs or selectbox or radio buttons group.\n\n<h3 id=\"checkbox_field_settings\">Checkboxes</h3>\nFields of this type inherit all features and settings of \"<em>select list</em>\" field type. The only difference is that the backend displays as checkboxes group of HTML input elements, so it is possible to choose more than one option. To show this field - first of all on the configuration page admin must complete selection items. Listings can\'t be ordered by this content field, but can be searched by selected items. On the search form these items will be displayed as a group of checkboxes inputs or selectbox or radio buttons group.\n\nConfiguration options:\n\n<strong>Number of columns on single listing page</strong> - display items in 1, 2 or columns on the single listing page.\n\n<strong>How to display items</strong> - display all items with checked/unchecked marks or only checked items. Example of all items with checked/unchecked marks:\n\n<img src=\"[base_url]/wp-content/uploads/checkboxes_frontend.png\" alt=\"\" />\n\n<h3 id=\"website_field_settings\">Website URL</h3>\nAt the backend this is combination of 2 HTML inputs: the first input for a URL of link and the second for a text of link. Can\'t be ordered by its value, can\'t take part in search. At the frontend looks like a link. Has 5 configuration settings:\n\n<strong>Open link in new window</strong> - when checked - the system adds <em>target=\"blank\"</em> attribute to the link.\n\n<strong>Add nofollow attribute</strong> - when checked - the system adds <em>rel=\"nofollow\"</em> attribute to the link.\n\n<strong>Enable link text field</strong> - whether to use link text: entered by user or default link text (when next option enabled).\n\n<strong>Use default link text when empty</strong> - use default link text when user did not fill in own link text.\n\n<strong>Default link text</strong> - default link text is used when user did not fill in own link text.\n\nWhen no link text available, it was not filled in, it is disabled and default text is not entered or was disabled - whole URL will be displayed as link text.\n\n<h3 id=\"cemail_field_settings\">Email</h3>\nAt the backend displays as pure HTML input element. Can\'t be ordered by its value, can\'t take part in search. At the frontend looks like <em>mailto</em> link.\n\n<h3 id=\"datetime_field_settings\">Date-Time</h3>\nImplemented in 2 date fields - start and end date. Time dropboxes fields: hour and minute.\n\n<img src=\"[base_url]/wp-content/uploads/search_calendar_widget.png\" />\n\nAt the backend this field inherits the behaviour of jQuery UI datepicker widget. Has special configuration setting to include time-selection feature.\n\nCan be ordered by its value. Also in the search block this field renders as 2 separate inputs to search by date range.\n\n<h3 id=\"price_field_settings\">Price</h3>\nFields of this type has very much like behaviour as digital value field type, but it is always decimal and besides \"<em>Decimal separator</em>\" and \"<em>Thousands separator</em>\" settings it owns additional configuration settings.\n\n<strong>Currency symbol</strong> - this symbol will appear on frontend/backend pages.\n\n<strong>Currency symbol</strong> - choose preferred position of currency symbol/code.\n\n<strong>Decimal separator</strong> - decimal separator of price value, possible values: dot or comma.\n\n<strong>Hide decimals</strong> - show/hide decimals (cents) at the frontend.\n\n<strong>Thousands separator</strong> - the separator for thousands, millions, billions, ... Possible values: no separator, dot, comma or space.\n\nThe same special search configuration options as for digital number type:\n\n<strong>Search mode</strong> - 4 modes available:\n<ul>\n	<li>Enter exact number into the text input</li>\n	<li>Enter min-max numbers into the text inputs</li>\n	<li>Search using min-max combination of select boxes</li>\n	<li>Search range slider with steps from Min-Max options</li>\n	<li>Search range slider with step 1, enter exact range</li>\n</ul>\n<strong>Min-Max options</strong> - for 2nd and 3rd search modes. Complete the list of options for select boxes or range slider.\n\n<img src=\"[base_url]/wp-content/uploads/price_field_search_slider.png\" />\n\n<h3 id=\"hours_field_settings\">Opening hours</h3>\nThe only configuration option is <em>\"Time convention\"</em> - 12-hours clock or 24-hours clock. Can\'t be ordered by its value, can\'t take part in search.\n\n<img src=\"[base_url]/wp-content/uploads/opening_hours.png\" />\n\n<h3 id=\"fileupload_field_settings\">File upload</h3>\nThis field type a bit similar to website type. But instead of filling URL user uploads a file, which then could be downloaded at the frontend.\n\n<strong>Enable file title field</strong> - whether to use file title: entered by user or default file title text (when next option enabled).\n\n<strong>Use default file title text when empty</strong> - use default file title text when user did not fill in own file title.\n\n<strong>Default file title text</strong> - default file title text is used when user did not fill in own file title.\n\nWhen no file title text available, it was not filled in, it is disabled and default text is not entered or was disabled - real file name will be displayed.\n\n<strong>Allowed file types</strong> - select file types, those allowed to be uploaded:\n<ul>\n	<li>Images (jpg, png, gif) (images)</li>\n	<li>Text (txt)</li>\n	<li>Microsoft Word Document (doc)</li>\n	<li>Microsoft Word Open XML Document (docx)</li>\n	<li>Excel Spreadsheet (xls)</li>\n	<li>Microsoft Excel Open XML Spreadsheet (xlsx)</li>\n	<li>Portable Document Format File (pdf)</li>\n	<li>Adobe Photoshop Document (psd)</li>\n	<li>Comma Separated Values File (csv)</li>\n	<li>PowerPoint Presentation (ppt)</li>\n	<li>PowerPoint Open XML Presentation (pptx)</li>\n	<li>MP3 Audio File (mp3)</li>\n	<li>Audio Video Interleave File (avi)</li>\n	<li>MPEG-4 Video File (mp4)</li>\n	<li>MPEG-4 Audio File (m4a)</li>\n	<li>Apple QuickTime Movie (mov)</li>\n	<li>MPEG Video File (mpg)</li>\n	<li>MIDI File (mid)</li>\n	<li>WAVE Audio File (wav)</li>\n	<li>Windows Media Audio File (wma)</li>\n	<li>Windows Media Video File (wmv)</li>\n</ul>\n\n<h3 id=\"category_specific_content_fields\">Category-specific content fields</h3>\nIt is possible configure additional content fields (except core fields) to display their inputs only when exact specific categories were checked on listings edition page. This is important and powerful feature allows to build category-specific content fields. Also when content field is searchable - it will appear on the search form (directly in search form or under advanced section) when visitor selects specific categories.\n\n<strong>For instance:</strong> there may be one \"<em>price</em>\" field configured especially for \"<em>Classifieds -> For sale</em>\" category. In such case this field appears only in listings, those were assigned with specific category.\n\n<h3 id=\"content_fields_groups\">Content fields groups</h3>\n<img src=\"[base_url]/wp-content/uploads/content_fields_groups.png\" />\n\nThis functionality allows to combine separate content fields into groups (including core fields) at the frontend listings single pages. There is an ability to place content fields group on a separate tab on single listing page, also ability to hide content fields group from anonymous users, they will only see the link to login page \"<em>You must be logged in to see this info</em>\".\n</div>\n\n[sc name=\"docs menu\"]', 'Content fields', '\n						', 'publish', 'closed', 'closed', '', 'content-fields', '', '', '2019-02-18 16:37:49', '2019-02-18 10:37:49', '', 17741, 'http://wp/?page_id=17867', 0, 'page', '', 0),
(17870, 2, '2019-02-18 16:40:02', '2019-02-18 10:40:02', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"search\">Search form</h2>\n\n<strong>&#091;mapbox-search&#093;</strong> shortcode has a bunch of own parameters. With this shortcode you can configure what to search and how to display on a separate search form. This separate search form can be connected with a map and/or listings by \"uID\" parameter in shortcode.\n\nComplete list of <strong>&#091;mapbox-search&#093;</strong> shortcode parameters you can find <a href=\"[base_url]/shortcodes/\">here</a>.\n\nSearch form is divided into 2 sections: \"<em>Main search block</em>\" and \"<em>Advanced search block</em>\" (hide/show by \"More filters\" and \"Less filters\" links).\n\n<a href=\"[base_url]/documentation/settings/search/\">Search settings</a> allows to switch on/off particular search fields and functionality. <a href=\"[base_url]/documentation/settings/customization/\">Customization settings</a> allows to configure background color, text color, background opacity and disable overlay (transparent waves) of the search form.\n\n<img src=\"[base_url]/wp-content/uploads/locations_search_options.png\" />\n\n<h3>Main search block</h3>\nThis section includes 2 fields and radius slider:\n<ol>\n	<li><strong>Keywords + Categories</strong> - possible to disable search by keywords and categories dropdown menu in the <a href=\"[base_url]/documentation/settings/search/\">search settings</a>. Also configure categories nesting level. This field has autocomplete functionality, it suggests listings and categories by first entered letters. When visitor enters keyword, the system searches through categories names and gives listings from corresponding categories, also it searches <strong>exact matches</strong> in listings titles, content and excerpt fields. Clear field to \"reset\" categories search.</li>\n	<li><strong>Address + Locations</strong> - possible to disable search by address and locations dropdown menu in the <a href=\"[base_url]/documentation/settings/search/\">search settings</a>. Also configure locations nesting level. This field has autocomplete functionality, it suggests locations by first entered letters and addresses or postal codes from MapBox service. When visitor enters keyword in this field, the system searches through locations names and gives listings from corresponding locations, also it searches <strong>exact matches</strong> in listings addresses (address line 1, address line 2, zip or postal code). Clear field to \"reset\" locations search.</li>\n	<li><strong>Radius slider</strong> - is used along with search by address. Visitors can find map markers in the radius of X miles/kilometers from entered address.\n<i class=\"fa fa-exclamation-triangle\"></i> It is required for listings to have map markers on the map to be searchable by radius.</li>\n</ol>\n+ Search by <a href=\"[base_url]/documentation/content-fields/\">content fields</a> when they configured to take part in the search. Not all content fields have an ability to search listings by their values.\n\n<h3>Advanced search block</h3>\nThis block is hidden by default and used only for search by <a href=\"[base_url]/documentation/content-fields/\">content fields</a>.\n<strong>&#091;mapbox-search&#093;</strong> shortcode can open advanced search section by default by \"advanced_open=1\" parameter.\n\n<h3 id=\"connect_shortcodes\">Connect Map and Search form</h3>\nIn order to connect search shortcode with map - enter uID parameter in the <a href=\"[base_url]/documentation/maps-management/settings/\">Map settings metabox</a>.\n\n<img src=\"[base_url]/wp-content/uploads/uid_map_parameter.png\" />\nPlace both shortcodes in the page description. And the same parameter for the <strong>&#091;mapbox-search&#093;</strong> shortcode:\n<img src=\"[base_url]/wp-content/uploads/uid_search_parameter.png\" />\n</div>\n\n[sc name=\"docs menu\"]		', 'Search form', '\n						', 'publish', 'closed', 'closed', '', 'search', '', '', '2019-02-18 16:40:02', '2019-02-18 10:40:02', '', 17741, 'http://wp/?page_id=17870', 0, 'page', '', 0),
(17873, 2, '2019-02-18 16:41:43', '2019-02-18 10:41:43', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"ordering\">Sorting of listings</h2>\nListings sorting at the map sidebar controls by <a href=\"[base_url]/documentation/maps-management/listings-sidebar/\">\"Listings sidebar\" metabox</a>.\n\nBy default it sorts listings by date, but there are options to sort by title, rating, additional content fields values. When user searches listings in radius - default sorting is by distance from center point.\n\n<img src=\"[base_url]/wp-content/uploads/listings_sidebar.png\" />\n\n<i class=\"fa fa-star\"></i> Some <a href=\"[base_url]/documentation/content-fields\">content fields</a> types, like date-time, number, price, text string types have own setting to allow order by these fields.\n\nOrder by rating allows only when ratings addon enabled.\n\n</div>\n\n[sc name=\"docs menu\"]				', 'Sorting of Listings', '\n						', 'publish', 'closed', 'closed', '', 'sorting-of-listings', '', '', '2019-02-18 16:41:43', '2019-02-18 10:41:43', '', 17741, 'http://wp/?page_id=17873', 0, 'page', '', 0),
(17875, 2, '2019-02-18 16:43:49', '2019-02-18 10:43:49', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"maps\">Maps & Markers Icons</h2>\n\nMarkers Icons depends on the type selected in <a href=\"[base_url]/documentation/settings/maps-addresses/\">Maps & Addresses settings</a>, Font Awesome icons and PNG images.\n\nHere is simple example of how MapBox map looks with custom marker icons and radius search cycle:\n\n<img src=\"[base_url]/wp-content/uploads/mapbox.png\" />\n\nAttention to the left side search panel. Visitors can search listings and view map markers directly on the map plus a list of found listings below search form.\n\nWhen \"Allow users to select markers\" <a href=\"[base_url]/documentation/settings/maps-addresses/\">setting</a> is checked - in listings creation/edition page users are able to select custom marker icons.\n\nOn the listings creation/edition page there is an option to set marker coordinates (<em>latitude and longitude</em>) manually or by drag & drop of existing marker by mouse.\n\n<img src=\"[base_url]/wp-content/uploads/location_enter.png\" />\n\nClicking <em>\"Generate on the map\"</em> button processes targeting and compiling of addresses to render markers on the map.\n\n<h3 id=\"connect_shortcodes\">Connect Map and Search form</h3>\nIn order to connect search shortcode with map - enter uID parameter in the <a href=\"[base_url]/documentation/maps-management/settings/\">Map settings metabox</a>.\n\n<img src=\"[base_url]/wp-content/uploads/uid_map_parameter.png\" />\nPlace both shortcodes in the page description. And the same parameter for the <strong>&#091;mapbox-search&#093;</strong> shortcode:\n<img src=\"[base_url]/wp-content/uploads/uid_search_parameter.png\" />\n\nComplete list of <strong>&#091;mapbox-search&#093;</strong> shortcode parameters you can find <a href=\"[base_url]/shortcodes/\">here</a>.\n</div>\n\n[sc name=\"docs menu\"]		', 'Maps & Markers Icons', '\n						', 'publish', 'closed', 'closed', '', 'maps', '', '', '2019-02-18 16:43:49', '2019-02-18 10:43:49', '', 17741, 'http://wp/?page_id=17875', 0, 'page', '', 0),
(17879, 2, '2019-02-18 16:49:17', '2019-02-18 10:49:17', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"frontend\">Frontend submission &amp; dashboard</h2>\n\nThese features become available when \"<em>Frontend submission &amp; dashboard addon</em>\" was enabled.\n\nCreate new page with <strong>&#091;mapbox-dashboard&#093;</strong> shortcode if you wish your logged in users to manage their listings and profile on the frontend dashboard page.\n\n\"<em>Submit new listing</em>\" button appears on front panel, clicking this button - users start the process of listing creation divided in some steps. Note, that the page with <strong>&#091;mapbox-submit&#093;</strong> shortcode required.\n\n<i class=\"fa fa-exclamation-triangle\"></i> Pages with <strong>&#091;mapbox-submit&#093;</strong> and <strong>&#091;mapbox-dashboard&#093;</strong> shortcodes must not have parent or child pages, they must be public, not private, not in trash.\n\nAfter successful submission new listing will be created. According to <em>\"Enable pre-moderation of listings\"</em> setting - listing post status will become: Pending Review or Published.\n\nThere are <a href=\"[base_url]/documentation/settings/frontend-submission/\">some settings</a> for frontend submission addon on General settings tab.\n</div>\n\n[sc name=\"docs menu\"]		', 'Frontend submission & dashboard', '\n						', 'publish', 'closed', 'closed', '', 'frontend', '', '', '2019-02-18 16:49:17', '2019-02-18 10:49:17', '', 17741, 'http://wp/?page_id=17879', 0, 'page', '', 0),
(17887, 2, '2019-02-18 16:53:28', '2019-02-18 16:53:28', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"widgets\">Maps widgets</h2>\nMapBox Locator plugin provides 2 types of widgets to display maps and search forms.\n\n<img src=\"[base_url]/wp-content/uploads/widgets.png\" />\n\nUse them on one page and connect by the same <a href=\"[base_url]/documentation/search/#connect_shortcodes\">uID parameter</a>.\n\n<i class=\"fa fa-star\"></i> Widgets settings are quite similar to shortcodes parameters. You can find detailed list of parameters <a href=\"[base_url]/shortcodes/\">here</a>.\n</div>\n\n[sc name=\"docs menu\"]		', 'Widgets', '\n						', 'publish', 'closed', 'closed', '', 'widgets', '', '', '2019-02-18 16:53:28', '2019-02-18 16:53:28', '', 17741, 'http://wp/?page_id=17887', 0, 'page', '', 0),
(17891, 2, '2019-02-18 16:57:13', '2019-02-18 10:57:13', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"customization\">Customization styles and templates</h2>\nThe customization of the plugin does require some experience in HTML, CSS and even PHP to change the templates around to an arbitrary theme look. Plugin\'s styles and templates are designed to work relatively well with most themes, but if you do have the need to modify any template and add or remove styles - try to follow these conditions:\n<ul>\n	<li>Create new folder in your child theme <em>\"w2mb-plugin/\"</em>. You will place custom files in this folder.</li>\n	<li>If you want to change the layout or styles of maps section on your site do not modify existing CSS files, instead create new file and give it exactly the same name, just add <strong>-custom</strong> postfix to the end of name before file\'s extension. For example, <em>resources/css/frontend.css</em> file from the plugin folder must have following name and placed into <em>w2mb-plugin/resources/css/frontend-custom.css</em> folder of your child theme. Using this method will save your modifications and custom code during further updates.</li>\n	<li>The same convention for any templates - .tpl files in <em>templates/</em> folder. For example, custom <em>templates/frontend/index.tpl.php</em> template must have following name and placed into <em>w2mb-plugin/templates/frontend/index-custom.tpl.php</em> folder of your child theme.\n<i class=\"fa fa-exclamation-triangle\"></i> Relative path of custom file in your child theme <em>\"w2mb-plugin/\"</em> folder must be exactly the same as the path of original file. <em>resources/css/</em> will be <em>w2mb-plugin/resources/css/</em>, <em>templates/frontend/</em> will be <em>w2mb-plugin/templates/frontend/</em>.\nTemplates of addons place in own folders. For example, <em>addons/w2mb_fsubmit/templates/</em> will be <em>w2mb-plugin/templates/w2mb_fsubmit/</em> in your child theme.</li>\n	<li>Other part of customization is that you can manage <a href=\"[base_url]/documentation/maps-categories\">categories icons</a>, <a href=\"[base_url]/documentation/maps-locations\">locations icons</a> and <a href=\"[base_url]/documentation/settings/maps-addresses/#map_infowindow_settings\">map markers icons</a>.\nCustom icons files place in the same way as CSS and templates, in your child theme <em>\"w2mb-plugin/\"</em> folder.\n<em>w2mb-plugin/resources/images/categories_icons/</em>, <em>w2mb-plugin/resources/images/locations_icons/</em>, <em>w2mb-plugin/resources/images/map_icons/</em> folders for categories icons, locations icons and map markers icons accordingly.</li>\n	<li>Inside <em>resources/sass/</em> folder the plugin contains SASS files for the frontend and backend parts including RTL styles.</li>\n</ul>\n\nMapBox Locator plugin has special customization settings to change some elements on frontend pages like links and buttons colors, background of the search form, primary and secondary colors, jQuery UI style.\n</div>\n\n[sc name=\"docs menu\"]		', 'Customization styles & templates', '\n						', 'publish', 'closed', 'closed', '', 'customization', '', '', '2019-02-18 16:57:13', '2019-02-18 10:57:13', '', 17741, 'http://wp/?page_id=17891', 0, 'page', '', 0),
(17893, 2, '2019-02-18 16:58:32', '2019-02-18 10:58:32', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"change_texts\">How to modify texts</h2>\nIf you use WordPress in English and simply want to modify one or some words of the plugin, then follow these steps:\n<ol>\n	<li>Download and install <a href=\"https://poedit.net/\" target=\"_blank\" rel=\"noopener noreferrer\">Poedit</a>.</li>\n	<li>Open with Poedit <em>languages/w2mb-en_US.po</em> file.</li>\n	<li>Now you can find and modify any needed words and texts.\n<img src=\"[base_url]/wp-content/uploads/poEdit.png\" />\n	<li>Every time you save <em>w2mb-en_US.po</em> file, Poedit automatically generates <em>w2mb-en_US.mo</em> file, which is the one WordPress uses and basically the only one you need to <strong>upload to your site</strong>.</li>\n	<li>Upload generated <em>w2mb-en_US.mo</em> file and saved <em>w2mb-en_US.po</em> file to your site into <em>wp-content/languages/plugins/</em> folder. You can use FTP client or FTP manager of your hosting.</li>\n</ol>\n</div>\n\n[sc name=\"docs menu\"]		', 'How to modify texts', '\n						', 'publish', 'closed', 'closed', '', 'change-texts', '', '', '2019-02-18 16:58:32', '2019-02-18 10:58:32', '', 17741, 'http://wp/?page_id=17893', 0, 'page', '', 0),
(17895, 2, '2019-02-18 17:03:59', '2019-02-18 11:03:59', '<div class=\"w2mb-docs w2mb-docs-side\">\r\n<h2 id=\"translations\">Translation</h2>\r\nMapBox Locator plugin is ready for use in any languages. The <em>languages/</em> folder contains W2MB-en_US.po file, which is used for translations. The process of translation is quite similar to <a href=\"[base_url]/documentation/change-texts/\">modifying texts</a> with <a href=\"https://poedit.net/\" target=\"_blank\" rel=\"noopener noreferrer\">PoEdit</a> application. The only difference is that before translation you need to duplicate W2MB-en_US.po file and give a name to new file according to following rules:\r\n<ol>\r\n<li>On Wordpress <em>Settings -> General</em> page select needed site language.\r\n<img src=\"[base_url]/wp-content/uploads/language.png\" />\r\n	<li>Make a copy of the <em>W2MB-en_US.po</em> file and rename it to <em>W2MB-WP_LOCALE.po</em> according to your <a href=\"https://make.wordpress.org/polyglots/teams/\" target=\"_blank\" rel=\"noopener noreferrer\">WP Locale</a></li>\r\n	<li>Example for the Portuguese Brazil language: <em>W2MB-pt_BR.po</em>\r\n    -- pt_BR - is the WP Locale, it means Portuguese (Brazil) language\r\n    -- you\'ll have to fill in with your own language, the list of WordPress locales <a href=\"https://make.wordpress.org/polyglots/teams/\" target=\"_blank\" rel=\"noopener noreferrer\">here</a></li>\r\n<li>Download and install <a href=\"https://poedit.net/\" target=\"_blank\" rel=\"noopener noreferrer\">Poedit</a>.</li>\r\n	<li>Open with Poedit <em>W2MB-pt_BR.po</em> file.</li>\r\n	<li>Now you can find and modify any needed words and texts.\r\n<img src=\"[base_url]/wp-content/uploads/poEdit.png\" />\r\n	<li>Every time you save translated <em>W2MB-WP_LOCALE.po</em> file, PoEdit automatically generates <em>W2MB-WP_LOCALE.mo</em> file, which is the one WordPress uses and basically the only one you need to <strong>upload to your site</strong>.</li>\r\n	<li>Upload generated <em>W2MB-WP_LOCALE.mo</em> file and saved <em>W2MB-WP_LOCALE.po</em> file to your site into <em>wp-content/languages/plugins/</em> folder. You can use FTP client or FTP manager of your hosting.</li>\r\n</ol>\r\n</div>\r\n\r\n[sc name=\"docs menu\"]		', 'Translation', '\n						', 'publish', 'closed', 'closed', '', 'translation', '', '', '2020-07-09 08:27:44', '2020-07-09 08:27:44', '', 17741, 'http://wp/?page_id=17895', 0, 'page', '', 0),
(17898, 2, '2019-02-18 17:06:25', '2019-02-18 11:06:25', '<div class=\"w2mb-docs w2mb-docs-side\">\r\n<h2 id=\"import\">CSV Import</h2>\r\nWe placed sample CSV file in \"<strong><em>documentation/</em></strong>\" folder in the plugin archive.\r\n<ol>\r\n	<li>On the second step of importing you\'ll collate CSV headers of columns with existing listings fields, this means there isn\'t fixed format for CSV files.</li>\r\n	<li>The only required columns in CSV file, those will define new listings titles and level IDs. Also information about author must be provided - in any column of CSV file or by setting default author in settings.</li>\r\n	<li>In order to assign some categories/locations/tags with each listing - specify existing category/location/tag name, slug or ID in one CSV column and separate them with special delimiter. This delimiter must be any string character, but not the same as the delimiter for separation of CSV columns.</li>\r\n	<li>You may set to auto-create new category/subcategory/location/sublocation/tag. In such case, when there isn\'t any existing category/subcategory/location/sublocation/tag with provided slug - new category/subcategory/location/sublocation/tag will be created automatically.</li>\r\n<li>Example of multiple subcategories import: \"<em>Business services > Advertising, Marketing & PR ; Real estate > Properties > Commercial</em>\". 2 root categories will be created, if they were not existed before import: \"<em>Business services</em>\" and \"<em>Real estate</em>\". And all their subcategories will be created in this hierarchy: \"<em>Advertising, Marketing & PR</em>\", \"<em>Properties</em>\" and \"<em>Commercial</em>\". Locations import works in the same way.</li>\r\n	<li>MultiValues - are such fields, those may have more than one value, for example, categories, locations, tags, images, YouTube videos, checkboxes content field items. Separate them in one CSV column with special delimiter in the same way as for assigned categories.</li>\r\n	<li>Also you may upload ZIP archive with images files for new listings. Specify names of images files in one CSV column and separate them with special delimiter in the same way as for assigned categories. In order to import images titles - specify them after each image file name by \">\" symbol, example: \"<em>goldengate_1024x768.jpg>Golden Gate</em>\". Note, that images files must be in the root inside ZIP archive, not inside folder.</li>\r\n	<li>By default listings authors will be specified in one of CSV columns, there must be existing user ID, user login or user email. Or you can switch to assign all new listings with one specific existing user.</li>\r\n	<li>Locations import works in the same way as categories import. Define already existing maps location name, slug or ID or set new locations names. Use \">\" symbol for locations-sublocations hierarchy. There are 2 fields for addresses: address line 1 and address line 2. So you can import in 2 ways: predefined locations (countries, states, cities, e.t.c.) in couple with addresses (street, building number, flat, e.t.c.) or only addresses fields with whole address. Also you may set special column for names of existed map icons files: for example, there is such map marker icon file \"<em>w2mb/resources/images/map_icons/icons/_new/Boat.png</em>\", so you have to place \"<em>_new/Boat.png</em>\" into CSV column. Using Font Awesome icons just place the name of icon \"<em>w2mb-fa-automobile</em>\".</li>\r\n	<li>When you do not have latitude/longitude information for map markers - geocoding service is used to get coordinates for map markers from addresses (CURL extention required). There is useful option \"Geocode imported listings by address parts\" on the second step of importing. MapBox (OpenStreetMap) Access Token required for correct geolocation of listings addresses. Get your MapBox Access Token <a href=\"https://www.mapbox.com/account/\" target=\"_blank\" rel=\"noopener noreferrer\">here</a>.</li>\r\n<li>All dates with or without time must be formatted in following way: \"dd.mm.yyyy HH:MM\" (time is optional)</li>\r\n<li>For YouTube videos specify full video URL or only its ID. You can separate some videos in one CSV column with special delimiter in the same way as for assigned categories.</li>\r\n<li>Opening hours content field import format: \"Mon 01:00 AM - 12:59 PM\". Days of week: Mon, Tue, Wed, Thu, Fri, Sat, Sun. Separate each day of week by comma. Missing days of week will be set as \"closed\".</li>\r\n	<li>There is an option to configure all imported listings as claimable, this option is shown when frontend submission addon was enabled and also claim functionality was switched on.</li>\r\n	<li>When the size of your CSV file is very large - this may slow down the server and break the process of import, you may try to split the file into smaller CSV files.</li>\r\n	<li>Recommended to make whole backup of the database before import.</li>\r\n\r\nGood tool can help to build CSV files is <a href=\"https://docs.google.com/spreadsheets/u/0/\" rel=\"noopener noreferrer\" target=\"_blank\">Google Spreadsheets</a>\r\n</ol>\r\n</div>\r\n\r\n[sc name=\"docs menu\"]		', 'Import', '\n						', 'publish', 'closed', 'closed', '', 'import', '', '', '2020-07-09 08:31:49', '2020-07-09 08:31:49', '', 17741, 'http://wp/?page_id=17898', 0, 'page', '', 0),
(17900, 2, '2019-02-18 17:07:14', '2019-02-18 11:07:14', '<div class=\"w2mb-docs w2mb-docs-side\">\r\n<h2 id=\"troubleshooting\">Troubleshooting</h2>\r\n\r\n<i class=\"fa fa-star\"></i> Before troubleshooting clear cache of your browser and cache on your site, if any caching system is used.\r\n\r\nMost of issues with the maps plugin are caused by wrong configuration in the settings, so the best solution is to look through plugin settings and set up them correctly. Another issues can be easily fixed by following below instructions.\r\n\r\nThe plugin follows WordPress coding standards and compatible with all themes and plugins, those follow the same standards. But in some cases problems might be caused by a conflict with your theme or another plugin. The very first step to find the reason of this conflict is to test your site with another theme and/or disable all plugins one by one. If you are not able to change your WP theme or disable conflicting plugin, then you can try to find a setting related to current problem, that can fix it.\r\n\r\n<h3 id=\"maps_problems\">Problems with the radius search, maps, address fields autocomplete</h3>\r\nThe most frequent reason is the MapBox Access Token. Check geolocation responce at the debug page of <a href=\"https://www.yoursite.com/wp-admin/admin.php?page=w2mb_debug\">your site</a>\r\n\r\n<i class=\"fa fa-exclamation-triangle\"></i> To test server API key you can visit debug page and check geolocation response. Debug page is placed on your site by similar URL <strong>http://www.yoursite.com/wp-admin/admin.php?page=w2mb_debug</strong>\r\n\r\n<h3 id=\"emails_problems\">Problems with emails sending</h3>\r\n<strong>Exemplary symptoms:</strong> users do not receive login details after first submission. Users do not receive notification emails. Admin does not receive notification emails. Emails go to spam folder.\r\n\r\nFirst of all check if needed notifications templates are filled in and not empty on <a href=\"[base_url]/documentation/settings/email-notifications/\">emails notifications</a> settings tab.\r\n\r\nIf notifications templates are filled in, but you still have problems with emails sending, this means, that your mail server on your site has wrong configuration. Try to install and configure SMTP plugin like this one <a href=\"https://wordpress.org/plugins/wp-mail-smtp/\" rel=\"noopener noreferrer\" target=\"_blank\">WP Mail SMTP plugin</a>.\r\n\r\n<h3 id=\"expiration_problems\">Listings never expire</h3>\r\n<strong>Exemplary symptoms:</strong> you\'ve set up listing level with limited active period. Expiration date has passed, but listings still active. This means scheduled events function does not work on your WordPress for some reason.\r\n\r\nFirst of all try to deactivate and then reactivate the plugin (you\'ll not lose any information). If this will not help - download and install <a href=\"https://wordpress.org/plugins/wp-crontrol/\" rel=\"noopener noreferrer\" target=\"_blank\">WP Crontrol plugin</a>, it should show \"scheduled_events\" in the list of Cron Events.\r\n\r\n<h3 id=\"update\">Can not update the plugin</h3>\r\n<strong>Exemplary symptoms:</strong> WordPress updater says something like \"Update Failed: Update package not available\".\r\n\r\nCheck your Envato Personal Access Token and its permissions. Otherwise you can update manually as explained <a href=\"[base_url]/documentation/update/\">here</a>.\r\n\r\n<h3 id=\"translation\">Translation problems</h3>\r\n<strong>Question:</strong> I have made everything as you explained in <a href=\"[base_url]/documentation/translation/\" target=\"_blank\" rel=\"noopener noreferrer\">translation instructions</a>, but it does want to take my translation file.\r\n\r\n<strong>Answer:</strong> Double check everything you\'ve made step by step. Special attention to the name of translation files and paths where you place them.\r\nThere is no problem at the plugin\'s side. The plugin uses translation files in exactly the same way any other WordPress plugin does.\r\n\r\n<strong>Question:</strong> I have translated all strings from the W2MB.po file, but it still shows some untranslated texts at the frontend, like address, phone, website, country, e.t.c.\r\n\r\n<strong>Answer:</strong> These are names of content fields. It is user-generated content, you should translate these strings at the admin dashboard at the directory management pages (Maps Admin -> Content fields, Maps Admin -> Locations levels)\r\n\r\n<h3 id=\"registration\">How to register?</h3>\r\n<strong>Question:</strong> There is only login form. I do not see how users can register at the site to submit or claim a listing. Where is registration form?\r\n\r\n<strong>Answer:</strong> This is because you disabled registration in WordPress settings of your site. Check \"Anyone can register\" option on the WordPress Settings -> General page. Registration link will appear below the login form.\r\n\r\n<h3 id=\"javascript_errors\">Errors in javascript console of the browser</h3>\r\nJavascript errors could break different parts of functionality of the plugin: images gallery, radius slider, content fields, search forms and so on. To see errors open browser console by pressing F12 and refresh the page.\r\nUsually javascript errors could be caused by 3rd party plugins or installed theme. Sometimes another plugin or your theme tries to \"format\" the output of maps plugin, this also can give odd behaviour due to unnecessary tags in page markup, like paragraphs, divs or spans tags. The only way to fix this - to look through plugins/theme settings and find an option to disable \"formatting\".\r\n\r\n<img src=\"[base_url]/wp-content/uploads/javascript_errors.png\" />\r\n\r\n</div>\r\n\r\n[sc name=\"docs menu\"]		', 'Troubleshooting', '\n						', 'publish', 'closed', 'closed', '', 'troubleshooting', '', '', '2020-07-09 08:33:45', '2020-07-09 08:33:45', '', 17741, 'http://wp/?page_id=17900', 0, 'page', '', 0);
