(17948, 2, '2019-02-22 17:59:42', '2019-02-22 11:59:42', '<div class=\"w2mb-docs w2mb-docs-side\">\nTips to install demo content on the \"<em>Maps Admin -> Demo data import</em>\" page:\n<ol>\n	<li>Demo Data Import tool will help you to install some demo content, such as listings and pages with examples of the shortcodes usage.</li>\n	<li>Each time you click import button - it creates new set of listings and pages. Avoid duplicates.</li>\n	<li>Import will not add pages in your navigation menus.</li>\n	<li>This is not 100% copy of the demo site. Just gives some examples of the shortcodes usage. FInal view and layout depends on your theme options.</li>\n</ol>\n</div>\n\n[sc name=\"docs menu\"]		', 'Demo data Import', '\n						', 'publish', 'closed', 'closed', '', 'demo-content', '', '', '2019-02-22 17:59:42', '2019-02-22 11:59:42', '', 17741, 'http://wp/?page_id=17948', 0, 'page', '', 0),
(18253, 2, '2019-04-06 12:26:31', '2019-04-06 12:26:31', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"maps_backend\">Maps Management</h2>\nMaps management begins from creation of the map on \"<em>MapBox Maps -> Create new map</em>\" page.\n\n<img src=\"[base_url]/wp-content/uploads/maps_backend.png\" />\n\nCrete new map and place its shortcode in page description.\n\n<img src=\"[base_url]/wp-content/uploads/shortcode.png\" />\n</div>\n\n[sc name=\"docs menu\"]	', 'Maps Management', '', 'publish', 'closed', 'closed', '', 'maps-management', '', '', '2019-04-06 12:26:31', '2019-04-06 12:26:31', '', 17741, 'http://wp_mapbox/?page_id=18253', 0, 'page', '', 0),
(18259, 2, '2019-04-06 12:46:29', '2019-04-06 12:46:29', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"map_backend\">Map Settings Metabox</h2>\nFollowing settings appear in the map settings metabox:\n\n<strong>uID</strong> - enter the same string in <strong>&#091;mapbox-search&#093;</strong> shortcode to <a href=\"[base_url]/documentation/search/#connect_shortcodes\">connect both shortcodes</a>\n\n<strong>Max number of markers</strong> - number of markers to display on map (empty field gives all markers)\n\n<strong>Map width</strong> - set map width in pixels. With empty field the map will take all possible width.\n\n<strong>Map height</strong> - set map height in pixels, also possible to set 100% value.\n\n<strong>MapBox style</strong> - select preferred MapBox map style.\n\n<strong>Make map to be sticky on scroll</strong> - makes the map to be sticky on scroll.\n\n<strong>Sticky scroll top padding</strong> - sticky scroll top padding in pixels.\n\n<strong>Group map markers in clusters</strong> - map markers will be groupped in clusters.\n\n<strong>Enable automatic user Geolocation</strong> - requires https on the site.\n\n<strong>Show \"Read more\" button</strong> - this button opens listing window.\n\n<strong>Show \"Directions\" button</strong> - this button provides directions to the selected location.\n\n<strong>Directions sidebar opened by default</strong> - whether to open directions panel near the map by default.\n\n<img src=\"[base_url]/wp-content/uploads/metabox_map_settings.png\"  class=\"alignnone size-full wp-image-18332\" />\n</div>\n\n[sc name=\"docs menu\"]	', 'Map Settings Metabox', '', 'publish', 'closed', 'closed', '', 'settings', '', '', '2019-04-06 12:46:29', '2019-04-06 12:46:29', '', 18253, 'http://wp_mapbox/?page_id=18259', 0, 'page', '', 0),
(18264, 2, '2019-04-07 13:27:14', '2019-04-07 13:27:14', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"map_ajax_loading\">Map AJAX Loading Metabox</h2>\nFollowing settings allows to load map markers and their info windows on the fly:\n\n<strong>AJAX loading</strong> - when map contains lots of markers - this may slow down map markers loading. Select AJAX to speed up loading. Requires Starting Point coordinates Latitude and Longitude.\n\n<strong>Maps info window AJAX loading</strong> - this may additionaly speed up loading.\n\n<strong>Speed up loading on AJAX</strong> - сustom markers icons will be disabled in this mode. Only default icons will be used.\n\n<strong>Show spinner on AJAX requests</strong> - whether to show spinner while map markers are loading.\n\n<img src=\"[base_url]/wp-content/uploads/metabox_ajax_loading.png\"  class=\"alignnone size-full wp-image-18329\" />\n</div>\n\n[sc name=\"docs menu\"]	', 'Map AJAX Loading', '', 'publish', 'closed', 'closed', '', 'ajax-loading', '', '', '2019-04-07 13:27:14', '2019-04-07 13:27:14', '', 18253, 'http://wp_mapbox/?page_id=18264', 0, 'page', '', 0),
(18267, 2, '2019-04-07 13:45:58', '2019-04-07 13:45:58', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"map_starting_point\">Map starting point and radius Metabox</h2>\nBy default all map markers loading to fit map bounds. To set up specific view on the map fill in starting point coordinates and zoom or set up a radius.\n\n<strong>Use map starting point and zoom</strong> - use map starting point or uncheck to fit map bounds showing all markers on load. \n\n<strong>Starting Point Latitude</strong> - enter latitude of the starting point. Or drag the marker on the map below.\n\n<strong>Starting Point Longitude</strong> - enter longitude of the starting point. Or drag the marker on the map below.\n\n<strong>Starting zoom</strong> - select starting map zoom.\n\n<strong>Show markers in radius (miles)</strong> - only markers in the radius from starting point will be loaded.\n\n<strong>Show radius circle</strong> - display radius circle on map when radius filter provided.\n\n<img src=\"[base_url]/wp-content/uploads/metabox_starting_point.png\" class=\"alignnone size-full wp-image-18334\" />\n</div>\n\n[sc name=\"docs menu\"]	', 'Map starting point and radius', '', 'publish', 'closed', 'closed', '', 'starting-point', '', '', '2019-04-07 13:45:58', '2019-04-07 13:45:58', '', 18253, 'http://wp_mapbox/?page_id=18267', 0, 'page', '', 0),
(18271, 2, '2019-04-08 07:46:52', '2019-04-08 07:46:52', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"map_controls\">Map controls Metabox</h2>\n\n<strong>Enable Draw Panel</strong> - Very important: MySQL version must be 5.6.1 and higher or MySQL server variable \"thread stack\" must be 256K and higher. Ask your hoster about it if \"Draw Area\" does not work.\n\n<strong>Enable full screen button</strong> - whether to enable full screen button on the map.\n\n<strong>Map full screen opened by default</strong> - possible to set up full screen map opened by default.\n\n<strong>Enable zoom by mouse wheel</strong> - whether to enable zoom by mouse click.\n\n<strong>Enable map dragging on touch screen devices</strong> - enables tab and drag on touch screen devices.\n\n<strong>Center map on marker click</strong> - when user click map marker it positions in the center of map window. Does not work on AJAX loading maps.\n\n<strong>Zoom map on marker click</strong> - when user click map marker it zooms map window. Does not work on AJAX loading maps.\n\n<strong>Show locations counter</strong> - when to show locations counter in the bottom corner.\n\n<strong>Counter text</strong> - Example: Number of locations %d.\n<img src=\"[base_url]/wp-content/uploads/locations_counter.png\" />\n</div>\n\n[sc name=\"docs menu\"]	', 'Map controls', '', 'publish', 'closed', 'closed', '', 'controls', '', '', '2019-04-08 07:46:52', '2019-04-08 07:46:52', '', 18253, 'http://wp_mapbox/?page_id=18271', 0, 'page', '', 0),
(18276, 2, '2019-04-08 08:03:55', '2019-04-08 08:03:55', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"map_sidebar\">Listings sidebar Metabox</h2>\n\n<strong>Enable search and listings sidebar</strong> - whether to enable the search panel and listings sidebar near the map.\n\n<strong>Listings sidebar open by default</strong> - listings sidebar can be opened by default.\n\n<strong>Listings order by</strong> - select <a href=\"[base_url]/documentation/sorting-of-listings/\">sorting criteria</a>.\n\n<strong>Order direction</strong> - ascending or descending order.\n\n<img src=\"[base_url]/wp-content/uploads/listings_sidebar.png\" />\n\n<img src=\"[base_url]/wp-content/uploads/sidebar.png\" class=\"alignnone size-full wp-image-18337\" />\n</div>\n\n[sc name=\"docs menu\"]	', 'Listings sidebar', '', 'publish', 'closed', 'closed', '', 'listings-sidebar', '', '', '2019-04-08 08:03:55', '2019-04-08 08:03:55', '', 18253, 'http://wp_mapbox/?page_id=18276', 0, 'page', '', 0),
(18279, 2, '2019-04-08 08:08:37', '2019-04-08 08:08:37', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"map_search\">Search options Metabox</h2>\nFollowing settings manage search form on the map when it was enabled in Listings sidebar metabox.\n\n<strong>Enable keywords search</strong> - show keywords search on the search form.\n\n<strong>Enable listings autosuggestions by keywords</strong> - listings will be suggested by entered keyword.\n\n<strong>Default keywords</strong> - keywords field placeholders.\n\n<strong>Enable categories search</strong> - show categories search on the search form.\n\n<strong>Categories search depth level</strong> - categories search depth level on the search form (1,2,3).\n\n<strong>Select certain category in search</strong> - category that will be selected by default.\n\n<strong>List of categories in search</strong> - the only categories allowed to select in the search form.\n\n<strong>Enable locations search</strong> - show locations search on the search form.\n\n<strong>Locations search depth level</strong> - locations search depth level on the search form (1,2,3).\n\n<strong>Select certain location in search</strong> - location that will be selected by default.\n\n<strong>List of locations in search</strong> - the only locations allowed to select in the search form.\n\n<strong>Enable address search</strong> - show address search on the search form.\n\n<strong>Default address</strong> - address field placeholders.\n\n<strong>Enable radius search</strong> - whether to use search by radius. Default radius value selected in the Map starting point and radius metabox.\n\n<img src=\"[base_url]/wp-content/uploads/sidebar.png\" class=\"alignnone size-full wp-image-18337\" />\n</div>\n\n[sc name=\"docs menu\"]	', 'Search options', '', 'publish', 'closed', 'closed', '', 'search', '', '', '2019-04-08 08:08:37', '2019-04-08 08:08:37', '', 18253, 'http://wp_mapbox/?page_id=18279', 0, 'page', '', 0),
(18283, 2, '2019-04-08 08:45:35', '2019-04-08 08:45:35', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"map_markers\">Markers to display Metabox</h2>\nFollowing settings filter map markers, those could be displayed on the map.\n\n<strong>Select specific categories to display on the map</strong> - only markers of selected categories will be displayed.\n\n<strong>Select specific locations to display on the map</strong> - only markers of selected locations will be displayed.\n\n<strong>Include categories and locations children</strong> - include markers of all children of selected categories and locations, not only selected items.\n\n<strong>Enter ID of autho</strong> - map markers of listings of exact author.\n\n<strong>Exact listings</strong> - comma separated string of listings IDs. The map will display only markers of exact listings.\n\n<i class=\"fa fa-star\"></i> Also it is possible to filter by content fields values like on the search form. Filters depend on fields types.\n\n<img src=\"[base_url]/wp-content/uploads/metabox_markers_display.png\" alt=\"\" width=\"797\" height=\"892\" class=\"alignnone size-full wp-image-18340\" />\n</div>\n\n[sc name=\"docs menu\"]	', 'Markers to display', '', 'publish', 'closed', 'closed', '', 'markers', '', '', '2019-04-08 08:45:35', '2019-04-08 08:45:35', '', 18253, 'http://wp_mapbox/?page_id=18283', 0, 'page', '', 0),
