(18341, 1, '2020-07-09 08:08:29', '2020-07-09 08:08:29', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"maps_backend\">Maps Management</h2>\nMaps management begins from creation of the map on \"<em>MapBox Maps -> Create new map</em>\" page.\n\n<img src=\"[base_url]/wp-content/uploads/maps_backend.png\" />\n\nCrete new map and place its shortcode in page description.\n\n<img src=\"[base_url]/wp-content/uploads/shortcode.png\" />\n</div>\n\n[sc name=\"docs menu\"]	', 'Maps Management', '', 'inherit', 'closed', 'closed', '', '18253-autosave-v1', '', '', '2020-07-09 08:08:29', '2020-07-09 08:08:29', '', 18253, 'http://wp_mapbox/2020/07/09/18253-autosave-v1/', 0, 'revision', '', 0),
