(18347, 1, '2020-07-09 08:22:21', '2020-07-09 08:22:21', '<div class=\"w2mb-docs\">\r\n<h3><strong>&#091;mapbox&#093;</strong></h3>\r\nThis shortcode is used to build MapBox (OpenStreetMap) maps with listings locations as map markers. The best way is to build a map in Maps Manager and use such kind of shortcode &#091;mapbox id=XXX&#093;, but it\'s possible to build custom map shortcode using following additional attributes:\r\n<table>\r\n<tr><th>Parameter</th><th class=\"th-description\"></th><th>Default</th></tr>\r\n<tr><td><strong>id</strong></td><td>This is ID of the map created in the Maps Manager</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>num</strong></td><td>Number of markers to display on map (-1 gives all markers).</td><td class=\"td-center\">-1</td></tr>\r\n<tr><td><strong>uid</strong></td><td>Enter unique string to connect this shortcode with the search form.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>width</strong></td><td>Set map width (by default whole possible width).</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>height</strong></td><td>Set map height.</td><td class=\"td-center\">400</td></tr>\r\n<tr><td><strong>radius_circle</strong></td><td>Display radius cycle on map when radius filter provided.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>clusters</strong></td><td>Group map markers in clusters.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>sticky_scroll</strong></td><td>Makes the map to be sticky on scroll.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>sticky_scroll_toppadding</strong></td><td>Sticky scroll top padding in pixels.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>map_style</strong></td><td>MapBox (OpenStreetMap) style. Whole list in directory settings.</td><td class=\"td-center\">default</td></tr>\r\n<tr><td><strong>show_summary_button</strong></td><td>Show \"« Summary\" button in info window.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>show_readmore_button</strong></td><td>Show \"Read more »\" button in info window.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>directions_sidebar_open</strong></td><td>Directions sidebar opened by default.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>ajax_loading</strong></td><td>When map contains lots of markers - this may slow down map markers loading. Select AJAX to speed up loading. Requires Starting Address or Starting Point coordinates Latitude and Longitude.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>ajax_markers_loading</strong></td><td>Maps info window AJAX loading. This may additionally speed up loading.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>use_ajax_loader</strong></td><td>Show spinner on AJAX requests.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>counter</strong></td><td>Show locations counter.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>counter_text</strong></td><td>Show spinner on AJAX requests.</td><td class=\"td-center\">Number of locations %d</td></tr>\r\n<tr><td><strong>start_address</strong></td><td>When map markers load by AJAX - it should have starting point and starting zoom. Enter start address or select latitude and longitude. Example: 1600 Amphitheatre Pkwy, Mountain View, CA 94043, USA.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>start_latitude</strong></td><td>Starting point latitude.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>start_longitude</strong></td><td>Starting point longitude.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>start_zoom</strong></td><td>Starting point zoom. Value from 0 (auto zoom) to 19.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>geolocation</strong></td><td>Enable automatic user Geolocation.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>draw_panel</strong></td><td>Enable Draw Panel.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>enable_full_screen</strong></td><td>Enable full screen button.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>enable_full_screen_by_default</strong></td><td>Map full screen opened by default.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>enable_wheel_zoom</strong></td><td>Enable zoom by mouse wheel. For desktops.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td style=\"font-size: 14px;\"><strong>enable_dragging_touchscreens</strong></td><td>Enable map dragging on touch screen devices.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>center_map_onclick</strong></td><td>Center map on marker click.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>center_map_onclick</strong></td><td>Center map on marker click. Value from 0 (auto zoom) to 19.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>search_on_map</strong></td><td>Show search form and listings panel on the map.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>search_on_map_open</strong></td><td>Search form open by default.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>order_by</strong></td><td>Possible values: post_date, title, rand, distance - when listings search in radius. Also this is possible to order by some content fields, those types have ordering functionality: text string, date-time, digital number, price. Just need to set content field slug as this attribute.</td><td class=\"td-center\">post_date</td></tr>\r\n<tr><td><strong>order</strong></td><td>Direction of sorting: ASC or DESC.</td><td class=\"td-center\">ASC</td></tr>\r\n<tr><td><strong>show_keywords_search</strong></td><td>Show keywords search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>keywords_ajax_search</strong></td><td>Enable listings autosuggestions by keywords.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>what_search</strong></td><td>Default keywords on the search form.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_categories_search</strong></td><td>Show categories search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>categories_search_level</strong></td><td>Categories search depth level on the search form (1,2,3).</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>category</strong></td><td>Select certain category ID on the search form.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>exact_categories</strong></td><td>List of categories on the search form. Comma separated string of categories slugs or IDs.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_address_search</strong></td><td>Show address search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>address</strong></td><td>Default address in the search form, recommended to set default radius.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_locations_search</strong></td><td>Show locations search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>locations_search_level</strong></td><td>Locations search depth level on the search form (1,2,3).</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>location</strong></td><td>Select certain location ID on the search form.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>exact_locations</strong></td><td>List of locations on the search form. Comma separated string of locations slugs or IDs.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>author</strong></td><td>Enter ID of author.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>categories</strong></td><td>Comma separated string of categories IDs or slugs - use only IDs or only slugs.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>locations</strong></td><td>Comma separated string of locations IDs or slugs - use only IDs or only slugs.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>include_categories_children</strong></td><td>Include children of selected categories and locations. When enabled - any subcategories or sublocations will be included as well.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>post__in</strong></td><td>Exact listings. Comma separated string of listings IDs. Possible to display exact listings.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>field_<em>SLUG</em></td><td colspan=\"2\">Possible to filter by content fields values like on the search form. Filters depend on fields types:\r\n<ul>\r\n	<li><strong>Text string and Textarea</strong> - filter in the following format: <strong>field_<em>SLUG</em>=\"string\"</strong></li>\r\n	<li><strong>Digital value</strong> - here are 2 variants: when content field was configured to search by exact values - <strong>field_<em>SLUG</em>=\"number\"</strong>; when content field was configured to search by MIN and MAX values - <strong>field_<em>SLUG</em>_min=\"number\"</strong> and/or <strong>field_<em>SLUG</em>_max=\"number\"</strong></li>\r\n	<li><strong>Price</strong> - the same as for Digital value type</li>\r\n	<li><strong>Date-Time</strong> - define date range in the following format: <strong>field_<em>SLUG</em>_min=\"dd.mm.yyyy\"</strong> and/or <strong>field_<em>SLUG</em>_max=\"dd.mm.yyyy\"</strong></li>\r\n	<li><strong>Select list, Radio buttons and Checkboxes</strong> - filter in the following format: <strong>field_<em>SLUG</em>=\"comma separated selection items IDs\"</strong>. Select list, Radio buttons support only single ID.</li>\r\n</ul></td></tr>\r\n</table>\r\n\r\n<hr />\r\n\r\n<h3><strong>&#091;mapbox-search&#093;</strong></h3>\r\nThis shortcode builds the search form connected with the map. Parameters of this shortcode:\r\n<table>\r\n<tr><th>Parameter</th><th class=\"th-description\"></th><th>Default</th></tr>\r\n<tr><td><strong>uid</strong></td><td>Enter unique string to connect this shortcode with the map.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>advanced_open</strong></td><td>Advanced search panel is opened by default.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>show_keywords_search</strong></td><td>Show keywords search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>keywords_ajax_search</strong></td><td>Enable listings autosuggestions by keywords.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>keywords_placeholder</strong></td><td>Default keyword on the search form.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_categories_search</strong></td><td>Show categories search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>categories_search_level</strong></td><td>Categories search depth level on the search form (1,2,3).</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>category</strong></td><td>Select certain category ID on the search form.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>exact_categories</strong></td><td>List of categories on the search form. Comma separated string of categories slugs or IDs.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_address_search</strong></td><td>Show address search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>address</strong></td><td>Default address, recommended to set default radius.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_locations_search</strong></td><td>Show locations search on the search form.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>locations_search_level</strong></td><td>Locations search depth level on the search form (1,2,3).</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>location</strong></td><td>Select certain location ID on the search form.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>exact_locations</strong></td><td>List of locations on the search form. Comma separated string of locations slugs or IDs.</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>show_radius_search</strong></td><td>Show the search by radius.</td><td class=\"td-center\">1</td></tr>\r\n<tr><td><strong>radius</strong></td><td>Default radius.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>search_fields</strong></td><td>Select certain content fields in main search section (comma separated IDs).</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>search_fields_advanced</strong></td><td>Select certain content fields in advanced search section (comma separated IDs).</td><td class=\"td-center\"></td></tr>\r\n<tr><td><strong>search_bg_color</strong></td><td>Search form background HEX color.</td><td class=\"td-center\">by setting*</td></tr>\r\n<tr><td><strong>search_bg_opacity</strong></td><td>Search form background opacity (in percents).</td><td class=\"td-center\">100</td></tr>\r\n<tr><td><strong>search_text_color</strong></td><td>Search form text HEX color.</td><td class=\"td-center\">by setting*</td></tr>\r\n<tr><td><strong>search_overlay</strong></td><td>Enable/disable search form overlay image.</td><td class=\"td-center\">by setting*</td></tr>\r\n<tr><td><strong>scroll_to</strong></td><td>Scroll to listings, map or do not scroll after search button was pressed.</td><td class=\"td-center\">listings</td></tr>\r\n<tr><td><strong>hide_search_button</strong></td><td>Allows to hide search button.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>on_row_search_button</strong></td><td>Search button on one line with fields.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>sticky_scroll</strong></td><td>Make search form to be sticky on scroll.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>sticky_scroll_toppadding</strong></td><td>Sticky scroll top padding in pixels.</td><td class=\"td-center\">0</td></tr>\r\n<tr><td><strong>field_<em>SLUG</em></td><td colspan=\"2\">Possible to filter by content fields values. Filters depend on fields types:\r\n<ul>\r\n	<li><strong>Text string and Textarea</strong> - filter in the following format: <strong>field_<em>SLUG</em>=\"string\"</strong></li>\r\n	<li><strong>Digital value</strong> - here are 2 variants: when content field was configured to search by exact values - <strong>field_<em>SLUG</em>=\"number\"</strong>; when content field was configured to search by MIN and MAX values - <strong>field_<em>SLUG</em>_min=\"number\"</strong> and/or <strong>field_<em>SLUG</em>_max=\"number\"</strong></li>\r\n	<li><strong>Price</strong> - the same as for Digital value type</li>\r\n	<li><strong>Date-Time</strong> - define date range in the following format: <strong>field_<em>SLUG</em>_min=\"dd.mm.yyyy\"</strong> and/or <strong>field_<em>SLUG</em>_max=\"dd.mm.yyyy\"</strong></li>\r\n	<li><strong>Select list, Radio buttons and Checkboxes</strong> - filter in the following format: <strong>field_<em>SLUG</em>=\"comma separated selection items IDs\"</strong>. Select list, Radio buttons support only single ID.</li>\r\n</ul></td></tr>\r\n</table>\r\n\r\n<hr />\r\n\r\n<h3><strong>&#091;mapbox-submit&#093;</strong></h3>\r\nWorks only when <a href=\"https://www.salephpscripts.com/wordpress_maps/demo/documentation/#frontend\">Frontend submission & dashboard addon</a> was enabled. This shortcode builds listings submission pages.\r\n\r\n<hr />\r\n\r\n<h3><strong>&#091;mapbox-dashboard&#093;</strong></h3>\r\nWorks only when <a href=\"https://www.salephpscripts.com/wordpress_maps/demo/documentation/#frontend\">Frontend submission & dashboard addon</a> was enabled. Logged in users have an ability to manage their listings and profile on the frontend dashboard page. This shortcode doesn\'t have any parameters.\r\n\r\n<hr />\r\n\r\n<h3><strong>&#091;mapbox-submit-button&#093;</strong></h3>\r\nWorks only when <a href=\"https://www.salephpscripts.com/wordpress_maps/demo/documentation/#frontend\">Frontend submission & dashboard addon</a> was enabled. Renders \"<em>Submit new listing</em>\" button. This shortcode doesn\'t have any attributes.', 'Shortcodes', 'Aenean gravida dapibus mollis. Praesent non nisl risus. Morbi dolor mauris, sodales sed bibendum et, interdum sed orci.', 'inherit', 'closed', 'closed', '', '2143-revision-v1', '', '', '2020-07-09 08:22:21', '2020-07-09 08:22:21', '', 2143, 'http://wp_mapbox/2020/07/09/2143-revision-v1/', 0, 'revision', '', 0),
(18348, 1, '2020-07-09 08:26:54', '2020-07-09 08:26:54', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"translations\">Translation</h2>\nMapBox Locator plugin is ready for use in any languages. The <em>languages/</em> folder contains W2MB-en_US.po file, which is used for translations. The process of translation is quite similar to <a href=\"[base_url]/documentation/change-texts/\">modifying texts</a> with <a href=\"https://poedit.net/\" target=\"_blank\" rel=\"noopener noreferrer\">PoEdit</a> application. The only difference is that before translation you need to duplicate W2MB-en_US.po file and give a name to new file according to following rules:\n<ol>\n<li>On Wordpress <em>Settings -> General</em> page select needed site language.\n<img src=\"[base_url]/wp-content/uploads/language.png\" />\n	<li>Make a copy of the <em>w2mb-en_US.po</em> file and rename it to <em>w2mb-WP_LOCALE.po</em> according to your <a href=\"https://make.wordpress.org/polyglots/teams/\" target=\"_blank\" rel=\"noopener noreferrer\">WP Locale</a></li>\n	<li>Example for the Portuguese Brazil language: <em>w2mb-pt_BR.po</em>\n    -- pt_BR - is the WP Locale, it means Portuguese (Brazil) language\n    -- you\'ll have to fill in with your own language, the list of WordPress locales <a href=\"https://make.wordpress.org/polyglots/teams/\" target=\"_blank\" rel=\"noopener noreferrer\">here</a></li>\n<li>Download and install <a href=\"https://poedit.net/\" target=\"_blank\" rel=\"noopener noreferrer\">Poedit</a>.</li>\n	<li>Open with Poedit <em>w2mb-pt_BR.po</em> file.</li>\n	<li>Now you can find and modify any needed words and texts.\n<img src=\"[base_url]/wp-content/uploads/poEdit.png\" />\n	<li>Every time you save translated <em>w2mb-WP_LOCALE.po</em> file, PoEdit automatically generates <em>w2mb-WP_LOCALE.mo</em> file, which is the one WordPress uses and basically the only one you need to <strong>upload to your site</strong>.</li>\n	<li>Upload generated <em>w2mb-WP_LOCALE.mo</em> file and saved <em>w2mb-WP_LOCALE.po</em> file to your site into <em>wp-content/languages/plugins/</em> folder. You can use FTP client or FTP manager of your hosting.</li>\n</ol>\n</div>\n\n[sc name=\"docs menu\"]		', 'Translation', '', 'inherit', 'closed', 'closed', '', '17895-autosave-v1', '', '', '2020-07-09 08:26:54', '2020-07-09 08:26:54', '', 17895, 'http://wp_mapbox/2020/07/09/17895-autosave-v1/', 0, 'revision', '', 0),
(18349, 1, '2020-07-09 08:27:44', '2020-07-09 08:27:44', '<div class=\"w2mb-docs w2mb-docs-side\">\r\n<h2 id=\"translations\">Translation</h2>\r\nMapBox Locator plugin is ready for use in any languages. The <em>languages/</em> folder contains W2MB-en_US.po file, which is used for translations. The process of translation is quite similar to <a href=\"[base_url]/documentation/change-texts/\">modifying texts</a> with <a href=\"https://poedit.net/\" target=\"_blank\" rel=\"noopener noreferrer\">PoEdit</a> application. The only difference is that before translation you need to duplicate W2MB-en_US.po file and give a name to new file according to following rules:\r\n<ol>\r\n<li>On Wordpress <em>Settings -> General</em> page select needed site language.\r\n<img src=\"[base_url]/wp-content/uploads/language.png\" />\r\n	<li>Make a copy of the <em>W2MB-en_US.po</em> file and rename it to <em>W2MB-WP_LOCALE.po</em> according to your <a href=\"https://make.wordpress.org/polyglots/teams/\" target=\"_blank\" rel=\"noopener noreferrer\">WP Locale</a></li>\r\n	<li>Example for the Portuguese Brazil language: <em>W2MB-pt_BR.po</em>\r\n    -- pt_BR - is the WP Locale, it means Portuguese (Brazil) language\r\n    -- you\'ll have to fill in with your own language, the list of WordPress locales <a href=\"https://make.wordpress.org/polyglots/teams/\" target=\"_blank\" rel=\"noopener noreferrer\">here</a></li>\r\n<li>Download and install <a href=\"https://poedit.net/\" target=\"_blank\" rel=\"noopener noreferrer\">Poedit</a>.</li>\r\n	<li>Open with Poedit <em>W2MB-pt_BR.po</em> file.</li>\r\n	<li>Now you can find and modify any needed words and texts.\r\n<img src=\"[base_url]/wp-content/uploads/poEdit.png\" />\r\n	<li>Every time you save translated <em>W2MB-WP_LOCALE.po</em> file, PoEdit automatically generates <em>W2MB-WP_LOCALE.mo</em> file, which is the one WordPress uses and basically the only one you need to <strong>upload to your site</strong>.</li>\r\n	<li>Upload generated <em>W2MB-WP_LOCALE.mo</em> file and saved <em>W2MB-WP_LOCALE.po</em> file to your site into <em>wp-content/languages/plugins/</em> folder. You can use FTP client or FTP manager of your hosting.</li>\r\n</ol>\r\n</div>\r\n\r\n[sc name=\"docs menu\"]		', 'Translation', '\n						', 'inherit', 'closed', 'closed', '', '17895-revision-v1', '', '', '2020-07-09 08:27:44', '2020-07-09 08:27:44', '', 17895, 'http://wp_mapbox/2020/07/09/17895-revision-v1/', 0, 'revision', '', 0),
(18350, 1, '2020-07-09 08:31:49', '2020-07-09 08:31:49', '<div class=\"w2mb-docs w2mb-docs-side\">\r\n<h2 id=\"import\">CSV Import</h2>\r\nWe placed sample CSV file in \"<strong><em>documentation/</em></strong>\" folder in the plugin archive.\r\n<ol>\r\n	<li>On the second step of importing you\'ll collate CSV headers of columns with existing listings fields, this means there isn\'t fixed format for CSV files.</li>\r\n	<li>The only required columns in CSV file, those will define new listings titles and level IDs. Also information about author must be provided - in any column of CSV file or by setting default author in settings.</li>\r\n	<li>In order to assign some categories/locations/tags with each listing - specify existing category/location/tag name, slug or ID in one CSV column and separate them with special delimiter. This delimiter must be any string character, but not the same as the delimiter for separation of CSV columns.</li>\r\n	<li>You may set to auto-create new category/subcategory/location/sublocation/tag. In such case, when there isn\'t any existing category/subcategory/location/sublocation/tag with provided slug - new category/subcategory/location/sublocation/tag will be created automatically.</li>\r\n<li>Example of multiple subcategories import: \"<em>Business services > Advertising, Marketing & PR ; Real estate > Properties > Commercial</em>\". 2 root categories will be created, if they were not existed before import: \"<em>Business services</em>\" and \"<em>Real estate</em>\". And all their subcategories will be created in this hierarchy: \"<em>Advertising, Marketing & PR</em>\", \"<em>Properties</em>\" and \"<em>Commercial</em>\". Locations import works in the same way.</li>\r\n	<li>MultiValues - are such fields, those may have more than one value, for example, categories, locations, tags, images, YouTube videos, checkboxes content field items. Separate them in one CSV column with special delimiter in the same way as for assigned categories.</li>\r\n	<li>Also you may upload ZIP archive with images files for new listings. Specify names of images files in one CSV column and separate them with special delimiter in the same way as for assigned categories. In order to import images titles - specify them after each image file name by \">\" symbol, example: \"<em>goldengate_1024x768.jpg>Golden Gate</em>\". Note, that images files must be in the root inside ZIP archive, not inside folder.</li>\r\n	<li>By default listings authors will be specified in one of CSV columns, there must be existing user ID, user login or user email. Or you can switch to assign all new listings with one specific existing user.</li>\r\n	<li>Locations import works in the same way as categories import. Define already existing maps location name, slug or ID or set new locations names. Use \">\" symbol for locations-sublocations hierarchy. There are 2 fields for addresses: address line 1 and address line 2. So you can import in 2 ways: predefined locations (countries, states, cities, e.t.c.) in couple with addresses (street, building number, flat, e.t.c.) or only addresses fields with whole address. Also you may set special column for names of existed map icons files: for example, there is such map marker icon file \"<em>w2mb/resources/images/map_icons/icons/_new/Boat.png</em>\", so you have to place \"<em>_new/Boat.png</em>\" into CSV column. Using Font Awesome icons just place the name of icon \"<em>w2mb-fa-automobile</em>\".</li>\r\n	<li>When you do not have latitude/longitude information for map markers - geocoding service is used to get coordinates for map markers from addresses (CURL extention required). There is useful option \"Geocode imported listings by address parts\" on the second step of importing. MapBox (OpenStreetMap) Access Token required for correct geolocation of listings addresses. Get your MapBox Access Token <a href=\"https://www.mapbox.com/account/\" target=\"_blank\" rel=\"noopener noreferrer\">here</a>.</li>\r\n<li>All dates with or without time must be formatted in following way: \"dd.mm.yyyy HH:MM\" (time is optional)</li>\r\n<li>For YouTube videos specify full video URL or only its ID. You can separate some videos in one CSV column with special delimiter in the same way as for assigned categories.</li>\r\n<li>Opening hours content field import format: \"Mon 01:00 AM - 12:59 PM\". Days of week: Mon, Tue, Wed, Thu, Fri, Sat, Sun. Separate each day of week by comma. Missing days of week will be set as \"closed\".</li>\r\n	<li>There is an option to configure all imported listings as claimable, this option is shown when frontend submission addon was enabled and also claim functionality was switched on.</li>\r\n	<li>When the size of your CSV file is very large - this may slow down the server and break the process of import, you may try to split the file into smaller CSV files.</li>\r\n	<li>Recommended to make whole backup of the database before import.</li>\r\n\r\nGood tool can help to build CSV files is <a href=\"https://docs.google.com/spreadsheets/u/0/\" rel=\"noopener noreferrer\" target=\"_blank\">Google Spreadsheets</a>\r\n</ol>\r\n</div>\r\n\r\n[sc name=\"docs menu\"]		', 'Import', '\n						', 'inherit', 'closed', 'closed', '', '17898-revision-v1', '', '', '2020-07-09 08:31:49', '2020-07-09 08:31:49', '', 17898, 'http://wp_mapbox/2020/07/09/17898-revision-v1/', 0, 'revision', '', 0),
(18351, 1, '2020-07-09 08:32:58', '2020-07-09 08:32:58', '<div class=\"w2mb-docs w2mb-docs-side\">\r\n<h2 id=\"troubleshooting\">Troubleshooting</h2>\r\n\r\n<i class=\"fa fa-star\"></i> Before troubleshooting clear cache of your browser and cache on your site, if any caching system is used.\r\n\r\nMost of issues with the maps plugin are caused by wrong configuration in the settings, so the best solution is to look through plugin settings and set up them correctly. Another issues can be easily fixed by following below instructions.\r\n\r\nThe plugin follows WordPress coding standards and compatible with all themes and plugins, those follow the same standards. But in some cases problems might be caused by a conflict with your theme or another plugin. The very first step to find the reason of this conflict is to test your site with another theme and/or disable all plugins one by one. If you are not able to change your WP theme or disable conflicting plugin, then you can try to find a setting related to current problem, that can fix it.\r\n\r\n<h3 id=\"maps_problems\">Problems with the radius search, maps, address fields autocomplete</h3>\r\nThe most frequent reason is the MapBox Access Token. Check geolocation responce at the debug page of <a href=\"https://www.yoursite.com/wp-admin/admin.php?page=w2mb_debug\">your site</a>\r\n\r\n<i class=\"fa fa-exclamation-triangle\"></i> To test server API key you can visit debug page and check geolocation response. Debug page is placed on your site by similar URL <strong>http://www.yoursite.com/wp-admin/admin.php?page=w2mb_debug</strong>\r\n\r\n<h3 id=\"emails_problems\">Problems with emails sending</h3>\r\n<strong>Exemplary symptoms:</strong> users do not receive login details after first submission. Users do not receive notification emails. Admin does not receive notification emails. Emails go to spam folder.\r\n\r\nFirst of all check if needed notifications templates are filled in and not empty on <a href=\"[base_url]/documentation/settings/email-notifications/\">emails notifications</a> settings tab.\r\n\r\nIf notifications templates are filled in, but you still have problems with emails sending, this means, that your mail server on your site has wrong configuration. Try to install and configure SMTP plugin like this one <a href=\"https://wordpress.org/plugins/wp-mail-smtp/\" rel=\"noopener noreferrer\" target=\"_blank\">WP Mail SMTP plugin</a>.\r\n\r\n<h3 id=\"expiration_problems\">Listings never expire</h3>\r\n<strong>Exemplary symptoms:</strong> you\'ve set up listing level with limited active period. Expiration date has passed, but listings still active. This means scheduled events function does not work on your WordPress for some reason.\r\n\r\nFirst of all try to deactivate and then reactivate the plugin (you\'ll not lose any information). If this will not help - download and install <a href=\"https://wordpress.org/plugins/wp-crontrol/\" rel=\"noopener noreferrer\" target=\"_blank\">WP Crontrol plugin</a>, it should show \"scheduled_events\" in the list of Cron Events.\r\n\r\n<h3 id=\"update\">Can not update the plugin</h3>\r\n<strong>Exemplary symptoms:</strong> WordPress updater says something like \"Update Failed: Update package not available\".\r\n\r\nCheck your Envato Personal Access Token and its permissions. Otherwise you can update manually as explained <a href=\"[base_url]/documentation/update/\">here</a>.\r\n\r\n<h3 id=\"translation\">Translation problems</h3>\r\n<strong>Question:</strong> I have made everything as you explained in <a href=\"[base_url]/documentation/translation/\" target=\"_blank\" rel=\"noopener noreferrer\">translation instructions</a>, but it does want to take my translation file.\r\n\r\n<strong>Answer:</strong> Double check everything you\'ve made step by step. Special attention to the name of translation files and paths where you place them.\r\nThere is no problem at the plugin\'s side. The plugin uses translation files in exactly the same way any other WordPress plugin does.\r\n\r\n<strong>Question:</strong> I have translated all strings from the w2mb.po file, but it still shows some untranslated texts at the frontend, like address, phone, website, country, e.t.c.\r\n\r\n<strong>Answer:</strong> These are names of content fields. It is user-generated content, you should translate these strings at the admin dashboard at the directory management pages (Maps Admin -> Content fields, Maps Admin -> Locations levels)\r\n\r\n<h3 id=\"registration\">How to register?</h3>\r\n<strong>Question:</strong> There is only login form. I do not see how users can register at the site to submit or claim a listing. Where is registration form?\r\n\r\n<strong>Answer:</strong> This is because you disabled registration in WordPress settings of your site. Check \"Anyone can register\" option on the WordPress Settings -> General page. Registration link will appear below the login form.\r\n\r\n<h3 id=\"javascript_errors\">Errors in javascript console of the browser</h3>\r\nJavascript errors could break different parts of functionality of the plugin: images gallery, radius slider, content fields, search forms and so on. To see errors open browser console by pressing F12 and refresh the page.\r\nUsually javascript errors could be caused by 3rd party plugins or installed theme. Sometimes another plugin or your theme tries to \"format\" the output of maps plugin, this also can give odd behaviour due to unnecessary tags in page markup, like paragraphs, divs or spans tags. The only way to fix this - to look through plugins/theme settings and find an option to disable \"formatting\".\r\n\r\n<img src=\"[base_url]/wp-content/uploads/javascript_errors.png\" />\r\n\r\n</div>\r\n\r\n[sc name=\"docs menu\"]		', 'Troubleshooting', '\n						', 'inherit', 'closed', 'closed', '', '17900-revision-v1', '', '', '2020-07-09 08:32:58', '2020-07-09 08:32:58', '', 17900, 'http://wp_mapbox/2020/07/09/17900-revision-v1/', 0, 'revision', '', 0),
(18352, 1, '2020-07-09 08:33:32', '2020-07-09 08:33:32', '<div class=\"w2mb-docs w2mb-docs-side\">\n<h2 id=\"troubleshooting\">Troubleshooting</h2>\n\n<i class=\"fa fa-star\"></i> Before troubleshooting clear cache of your browser and cache on your site, if any caching system is used.\n\nMost of issues with the maps plugin are caused by wrong configuration in the settings, so the best solution is to look through plugin settings and set up them correctly. Another issues can be easily fixed by following below instructions.\n\nThe plugin follows WordPress coding standards and compatible with all themes and plugins, those follow the same standards. But in some cases problems might be caused by a conflict with your theme or another plugin. The very first step to find the reason of this conflict is to test your site with another theme and/or disable all plugins one by one. If you are not able to change your WP theme or disable conflicting plugin, then you can try to find a setting related to current problem, that can fix it.\n\n<h3 id=\"maps_problems\">Problems with the radius search, maps, address fields autocomplete</h3>\nThe most frequent reason is the MapBox Access Token. Check geolocation responce at the debug page of <a href=\"https://www.yoursite.com/wp-admin/admin.php?page=w2mb_debug\">your site</a>\n\n<i class=\"fa fa-exclamation-triangle\"></i> To test server API key you can visit debug page and check geolocation response. Debug page is placed on your site by similar URL <strong>http://www.yoursite.com/wp-admin/admin.php?page=w2mb_debug</strong>\n\n<h3 id=\"emails_problems\">Problems with emails sending</h3>\n<strong>Exemplary symptoms:</strong> users do not receive login details after first submission. Users do not receive notification emails. Admin does not receive notification emails. Emails go to spam folder.\n\nFirst of all check if needed notifications templates are filled in and not empty on <a href=\"[base_url]/documentation/settings/email-notifications/\">emails notifications</a> settings tab.\n\nIf notifications templates are filled in, but you still have problems with emails sending, this means, that your mail server on your site has wrong configuration. Try to install and configure SMTP plugin like this one <a href=\"https://wordpress.org/plugins/wp-mail-smtp/\" rel=\"noopener noreferrer\" target=\"_blank\">WP Mail SMTP plugin</a>.\n\n<h3 id=\"expiration_problems\">Listings never expire</h3>\n<strong>Exemplary symptoms:</strong> you\'ve set up listing level with limited active period. Expiration date has passed, but listings still active. This means scheduled events function does not work on your WordPress for some reason.\n\nFirst of all try to deactivate and then reactivate the plugin (you\'ll not lose any information). If this will not help - download and install <a href=\"https://wordpress.org/plugins/wp-crontrol/\" rel=\"noopener noreferrer\" target=\"_blank\">WP Crontrol plugin</a>, it should show \"scheduled_events\" in the list of Cron Events.\n\n<h3 id=\"update\">Can not update the plugin</h3>\n<strong>Exemplary symptoms:</strong> WordPress updater says something like \"Update Failed: Update package not available\".\n\nCheck your Envato Personal Access Token and its permissions. Otherwise you can update manually as explained <a href=\"[base_url]/documentation/update/\">here</a>.\n\n<h3 id=\"translation\">Translation problems</h3>\n<strong>Question:</strong> I have made everything as you explained in <a href=\"[base_url]/documentation/translation/\" target=\"_blank\" rel=\"noopener noreferrer\">translation instructions</a>, but it does want to take my translation file.\n\n<strong>Answer:</strong> Double check everything you\'ve made step by step. Special attention to the name of translation files and paths where you place them.\nThere is no problem at the plugin\'s side. The plugin uses translation files in exactly the same way any other WordPress plugin does.\n\n<strong>Question:</strong> I have translated all strings from the W2MB.po file, but it still shows some untranslated texts at the frontend, like address, phone, website, country, e.t.c.\n\n<strong>Answer:</strong> These are names of content fields. It is user-generated content, you should translate these strings at the admin dashboard at the directory management pages (Maps Admin -> Content fields, Maps Admin -> Locations levels)\n\n<h3 id=\"registration\">How to register?</h3>\n<strong>Question:</strong> There is only login form. I do not see how users can register at the site to submit or claim a listing. Where is registration form?\n\n<strong>Answer:</strong> This is because you disabled registration in WordPress settings of your site. Check \"Anyone can register\" option on the WordPress Settings -> General page. Registration link will appear below the login form.\n\n<h3 id=\"javascript_errors\">Errors in javascript console of the browser</h3>\nJavascript errors could break different parts of functionality of the plugin: images gallery, radius slider, content fields, search forms and so on. To see errors open browser console by pressing F12 and refresh the page.\nUsually javascript errors could be caused by 3rd party plugins or installed theme. Sometimes another plugin or your theme tries to \"format\" the output of maps plugin, this also can give odd behaviour due to unnecessary tags in page markup, like paragraphs, divs or spans tags. The only way to fix this - to look through plugins/theme settings and find an option to disable \"formatting\".\n\n<img src=\"[base_url]/wp-content/uploads/javascript_errors.png\" />\n\n</div>\n\n[sc name=\"docs menu\"]		', 'Troubleshooting', '', 'inherit', 'closed', 'closed', '', '17900-autosave-v1', '', '', '2020-07-09 08:33:32', '2020-07-09 08:33:32', '', 17900, 'http://wp_mapbox/2020/07/09/17900-autosave-v1/', 0, 'revision', '', 0),
